INSERT INTO `products` (`id`, `name`, `price`, `desc`, `quantity`, `supplier`, `image_path`, `category`) VALUES
(1, 'Zöld Plüss Kutya Játék', 2900, 'Fedezd fel a vidámságot és puhaságot a Zöld Plüss Kutya Játékkal! Ez a kedves játék nemcsak szórakozást nyújt, hanem puha, kényelmes társ is lehet a kis kedvenced számára. Kiváló minőségű, zöld színű plüss anyagból készült, amely kellemes tapintású és tartós. A játék nemcsak szórakoztató, de biztonságos is, hiszen erős varrásokkal és ellenálló anyagokkal készült.\r\nA termék mérete: 25 cm.', 10, 'Forgalmazó', 'imgs/productPhotos/jatek1.jpg', 'toy'),
(2, 'Narancssárga Gumi Labda', 2100, 'Ezzel a Narancssárga Kemény Gumi Labdával garantáltan felejthetetlen és aktív időt tölthet el kutyáddal. A kemény gumi anyag biztosítja a hosszú élettartamot, és a labda ideális mérete könnyűvé teszi a játékot minden kutyatulajdonos számára.\r\nA termék mérete: 6 cm.', 10, 'Forgalmazó', 'imgs/productPhotos/jatek2.jpg\r\n', 'toy'),
(3, 'Narancssárga Plüss Majom', 3800, 'Fedezd fel a vidámságot és puhaságot a Narancssárga Plüss Majommal! Ez a kedves plüss játék nemcsak aranyos, de puha és kényelmes is, ideális társ a kis kedvenced számára. Ezzel a Narancssárga Plüss Majommal garantáltan feldobja mindennapjait, és kényelmes társ lesz a játékban és a pihenésben egyaránt.\r\nA termék mérete: 25 cm.', 10, 'Forgalmazó', 'imgs/productPhotos/jatek3.jpg', 'toy'),
(4, 'Barna Plüss Maci', 3700, 'Fedezd fel a puhaságát és báját a Barna Plüss Macival! Ez a kedves játékmaci nem csak aranyos, hanem puha és kényelmes is, tökéletes társ a kis kedvenced számára. Ezzel a Barna Plüss Macival garantáltan mosolyt csalsz kis kedvenced arcára, és egy kényelmes játék- és alvópartnert is biztosítasz számára.\r\nA termék mérete: 25 cm.', 10, 'Forgalmazó', 'imgs/productPhotos/jatek4.jpg', 'toy'),
(5, 'Sárga Plüss Állat', 3400, 'Fedezd fel a varázslatát a Sárga Plüss Állattal! Ez a különleges játék nem csak szórakoztató, hanem rejtélyes és színes kiegészítője is lehet kis kedvenced napjainak. Ezzel a Sárga Plüss Állattal nemcsak egy aranyos játékot kapsz, hanem egy egyedi és szórakoztató kiegészítőt is a kutyád számára. Kíváncsiságát felkeltve és örömet szerezve lesz a napja!\r\nA termék mérete: 24 cm.', 10, 'Forgalmazó', 'imgs/productPhotos/jatek5.jpg', 'toy'),
(6, 'Zöld - Szürke Labda', 2200, 'Ez a Zöld Labda nem csupán egy egyszerű játék, hanem egy olyan kiegészítő, amely feldobja kutyád mindennapjait és örömöt hoz a közös játékba. Légy részese a vidám pillanatoknak, és élvezd a kutyáddal való együtt töltött időt!\r\nA termék mérete: 6 cm.', 10, 'Forgalmazó', 'imgs/productPhotos/jatek6.jpg', 'toy'),
(7, 'Sárga - Kék Labda', 2200, 'Fedezd fel a vibráló színek harmonikus találkozását a Sárga - Kék Labdával! Ez a lenyűgöző játék nem csak szórakoztató, de a színek dinamikus kombinációjával is elkápráztatja kutyád és a játék iránt érdeklődők szemét. Élvezd a színek dinamikus táncát minden játék alkalmával!\r\nA termék mérete: 6 cm.', 10, 'Forgalmazó', 'imgs/productPhotos/jatek7.jpg', 'toy'),
(8, 'Nagy Teniszlabda', 2900, 'Fedezd fel a hagyomány és a mozgás örömét a Nagy Teniszlabdával! Ez a hagyományos játék nemcsak egyszerű, de kiválóan alkalmas a kutyád aktív szórakoztatására és mozgására. Egyszerű, mégis hatékony eszköz a kutyád szórakoztatásához és mozgásához. Élvezd a játékos pillanatokat a hagyományok és a kutyaszeretet jegyében!\r\nA termék mérete: 12 cm.', 10, 'Forgalmazó', 'imgs/productPhotos/jatek8.jpg', 'toy'),
(9, 'Narancssárga - Szürke Labda', 2200, 'Ez a Narancssárga - Szürke Labda nem csupán egy egyszerű játék, hanem egy olyan kiegészítő, amely feldobja kutyád mindennapjait és örömöt hoz a közös játékba. Légy részese a vidám pillanatoknak, és élvezd a kutyáddal való együtt töltött időt!\r\nA termék mérete: 6 cm.\r\n\r\n', 10, 'Forgalmazó', 'imgs/productPhotos/jatek9.jpg', 'toy'),
(10, 'Narancssárga Gumilabda', 2300, 'Fedezd fel a játék és a frissítő szín találkozását a Narancssárga Lyukacsos Gumilabdával! Ez a különleges játék nemcsak élénk és szórakoztató, de a lyukakkal rendelkező kialakítása izgalmasabbá teszi kutyád játékidejét.\r\nA termék mérete: 6 cm.', 10, 'Forgalmazó', 'imgs/productPhotos/jatek10.jpg', 'toy'),
(11, 'Zöld Csontalakú Gumi Rágóka', 3300, 'Ismerd meg a Zöld Csontalakú Gumi Rágókát, a kutyád számára tervezett prémium rágókát! Ez a stílusos és strapabíró játék nem csak szórakoztató, de kiválóan alkalmas a rágás szükségleteinek kielégítésére és a fogak egészségének támogatására. Legyen ez az új kedvenc rágója!\r\nA termék mérete: 16 cm.', 10, 'Forgalmazó', 'imgs/productPhotos/jatek11.jpg', 'toy'),
(12, 'Könnyű Focilabda Kutyáknak', 5200, 'Ismerd meg a Könnyű Focilabdát Kutyáknak, a tökéletes játékszert, amely könnyű és strapabíró, ideális kutyád aktív szórakoztatására! Ez a labda nem csak könnyebb, mint az eredeti focilabda, de a strapabíró anyagnak köszönhetően hosszú órákon át tartó játékot biztosít.\r\nA termék mérete: 60 cm.', 10, 'Forgalmazó', 'imgs/productPhotos/jatek12.jpg', 'toy'),
(13, 'Színes Frizbi', 2100, 'Fedezd fel a vidám és aktív időtöltést a Színes Frizbivel! Ez a szórakoztató játék ideális a kutyád számára, hogy szabadban űzhesse a játékot, miközben a színes design fokozza a szórakozás élményét. Egy kiváló kiegészítő a kutyád számára, amely nem csak szórakoztató, hanem segíti az aktív mozgást és szabadban való játékot. Élvezd a közös időtöltést ezen vidám és könnyű játékkal!\r\nA termék mérete: 24 cm.', 10, 'Forgalmazó', 'imgs/productPhotos/jatek13.jpg', 'toy'),
(14, 'Narancssárga Sípoló Labda', 2200, 'Ismerd meg a Narancssárga Sípoló Labdát, a szórakoztató játékelemet, amely garantáltan felkelti kutyád érdeklődését és játékszenvedélyét! Ez a labda nem csak színes és vidám, de sípoló funkciója révén még izgalmasabbá teszi a játékot. Nem csak szórakoztató, hanem segíti is a kutyád fogápolását és aktív időtöltését. Kiváló választás az egészséges játékhoz és interakcióhoz!\r\nA termék mérete: 6 cm.', 10, 'Forgalmazó', 'imgs/productPhotos/jatek14.jpg', 'toy'),
(15, 'Puha Kosárlabda Kutyáknak', 5300, 'Ismerd meg a Puha Kosárlabdát Kutyáknak, a tökéletes játékot a kis kedvenceid aktív időtöltéséhez! Ez a kisebb méretű, könnyű és puha labda kiválóan alkalmas kutyád szórakoztatására és játékra. Egy szórakoztató és interaktív játékelem, amely garantáltan örömet szerez a kutyádnak, miközben a könnyű és puha kialakítás biztosítja a játék biztonságát és kényelmét. Legyen ez a labda a következő kutyajáték a repertoáron!\r\nA termék mérete: 58 cm.', 10, 'Forgalmazó', 'imgs/productPhotos/jatek15.jpg', 'toy'),
(16, 'Narancssárga Köteles Játék', 3100, 'Fedezd fel a kutyád számára tervezett Narancssárga Köteles Játékot, amely nem csak szórakoztató, de segíti is a fogápolást és rágási szokások kialakítását! Ez a játék kiváló választás a kutyád aktív és egészséges szórakoztatására. Nem csak szórakoztató, hanem segíti is a kutyád fogápolását és aktív időtöltését. Kiváló választás az egészséges játékhoz és interakcióhoz!\r\nA termék mérete: 30 cm.', 10, 'Forgalmazó', 'imgs/productPhotos/jatek16.jpg', 'toy'),
(17, 'Sötétbarna Plüss Maci', 3700, 'Ismerd meg a Sötétbarna Plüss Macit, a puhaság és báj tökéletes kombinációját! Ez a kiváló minőségű plüss játékmaci nemcsak aranyos, hanem puha tapintású is, ideális társ a kis kedvenced számára a játékban és a pihenésben. Nem csak egy játék, hanem egy hűséges és puha társ is, aki mindig készen áll arra, hogy örömöt szerezzen és kényeztessen. Legyen ez a bájos játékmaci a következő kedvenc alvótársa vagy játékpartnere!\r\nA termék mérete: 26 cm.', 10, 'Forgalmazó', 'imgs/productPhotos/jatek17.jpg', 'toy'),
(18, 'Klasszikus Teniszlabda', 2000, 'Fedezd fel a hagyomány és a mozgás örömét a Klasszikus Teniszlabdával! Ez a hagyományos játék nemcsak egyszerű, de kiválóan alkalmas a kutyád aktív szórakoztatására és mozgására. Egyszerű, mégis hatékony eszköz a kutyád szórakoztatásához és mozgásához. Élvezd a játékos pillanatokat a hagyományok és a kutyaszeretet jegyében! A termék mérete: 6 cm.', 10, 'Forgalmazó', 'imgs/productPhotos/jatek18.jpg', 'toy'),
(19, 'Tömör Gumi Bot Játék', 3400, 'Ismerd meg a Tömör Gumi Bot Játékot, a kiváló minőségű és strapabíró játékot kutyádnak! Ez a tömör gumi bot ideális választás az aktív játékhoz és rágási igények kielégítéséhez. Kiváló választás azoknak a kutyatulajdonosoknak, akik egy tartós és egyszerű játékot keresnek kutyájuknak. Legyen ez a bot a következő kedvenc játékja!\r\nA termék mérete: 38 cm.', 10, 'Forgalmazó', 'imgs/productPhotos/jatek19.jpg', 'toy'),
(20, 'Sípolós Gumi Malac Játék', 3600, 'Ismerd meg a Sípolós Gumi Malac Játékot, a vidám és interaktív játékelemet kutyádnak! Ez a játékmalac kiváló minőségű, tartós gumi anyagból készült, és sípoló funkcióval rendelkezik, hogy még izgalmasabbá tegye a játékot. Egy szórakoztató és színvonalas játékelem, amely nemcsak kielégíti a rágási igényeket, hanem örömet is szerez a kutyádnak. Legyen ez a vidám malac a következő kedvenc játéka!\r\nA termék mérete: 24 cm.', 10, 'Forgalmazó', 'imgs/productPhotos/jatek20.jpg', 'toy'),
(21, 'Szürke - Sárga Csont Rágóka', 2400, 'A Szürke Sárga Csont Rágóka egy stílusos kutyajáték, mely tökéletesen ötvözi a dizájnt és funkcionalitást. Kiváló minőségű szürke és sárga anyagokból készült, ideális az íny és fogak egészségének támogatásához. A különböző textúrájú felületek serkentik a rágási ösztönt, segítve az erős fogak és állkapocs kialakulását. A szórakoztató színkombináció és a rugalmas anyag fokozza a játék élményét, aktívan lefoglalva kutyádat. Ideális választás unaloműző tevékenységként. A méret optimalizált a biztonságos játékhoz, biztosan ez lesz kutyád kedvenc rágójátéka!\r\nA termék mérete: 30 cm.', 10, 'Forgalmazó', 'imgs/productPhotos/jatek21.jpg', 'toy'),
(22, 'Sárga Póráz', 2900, 'A Sárga Póráz frissességet és vidámságot hoz a kutyasétákba. Ez a praktikus és stílusos póráz nem csupán kényelmes irányítást biztosít, hanem kutyád megjelenését is feldobja.\r\nA póráz hossza 2 méter.', 10, 'Forgalmazó', 'imgs/productPhotos/poraz2.jpg', 'leash'),
(23, 'Fehér Póráz', 3200, 'A Fehér Póráz egyszerű eleganciát és tisztaságot sugároz, és kiváló választás a stílusos és kényelmes kutyasétákhoz. Készült strapabíró anyagból, hogy a mindennapos használat során is megállja a helyét.\r\nA póráz hossza 2 méter.', 10, 'Forgalmazó', 'imgs/productPhotos/poraz3.jpg', 'leash'),
(24, 'Fekete -Fehér Kockás Póráz', 3100, 'A Fekete-Fehér Kockás Póráz divatos és stílusos kiegészítő, amely egyesíti a klasszikus fekete és fehér színek eleganciáját a játékos kockás mintával. Ez a póráz nemcsak esztétikus, hanem strapabíró is, így ideális választás a mindennapos kutyasétákhoz.\r\nA póráz hossza 2 méter.', 10, 'Forgalmazó', 'imgs/productPhotos/poraz4.jpg', 'leash'),
(25, 'Fekete Bőr Póráz', 3000, 'A Fekete Bőr Póráz időtlen eleganciát sugároz, és egyúttal strapabíró és praktikus kiegészítője lehet kutyád sétáinak. Kiváló minőségű fekete bőrből készült, ez a póráz nemcsak stílusos, hanem hosszú távú használatra tervezett.\r\nA póráz hossza 2 méter.', 10, 'Forgalmazó', 'imgs/productPhotos/poraz5.jpg', 'leash'),
(26, 'Zöld Bőr Póráz', 2800, 'Fedezze fel stílusát a Zöld Bőr Pórázzal! Kifinomult design és funkcionalitás találkozik ebben a prémium minőségű pórázban. Készült környezetbarát, színtartó zöld bőrből, mely idővel még szebbé válik. Az erős és tartós kialakítás biztosítja, hogy kedvence mindig biztonságban legyen séták során. A póráz hossza ideális szabadságot ad a kutya számára, miközben a masszív fém csat és a erős varrások garantálják a megbízhatóságot. Kombinálja a stílust és a funkcionalitást ezzel az elegáns zöld bőr pórázzal, és tegye még emlékezetesebbé a sétákat!\r\nA póráz hossza 2 méter.', 10, 'Forgalmazó', 'imgs/productPhotos/poraz6.jpg', 'leash'),
(27, 'Lila Póráz', 2900, 'Kifinomult és stílusos sétákhoz válassza a Lila Pórázt! Ez a prémium minőségű póráz nemcsak szemet gyönyörködtető lila színével, hanem kényelmes és tartós kialakításával is lenyűgözi. Készült strapabíró anyagokból, hogy garantálja a hosszú élettartamot. Az ergonomikus fogantyú kényelmes fogást biztosít, míg a masszív fém csat könnyen és biztonságosan rögzíti a kutyát. A póráz hossza optimális mozgásszabadságot biztosítva egyensúlyt teremt a szabadság és a vezetés között. Engedje, hogy kedvence kifejezze egyediségét ezzel a stílusos és praktikus lila pórázzal!\r\nA póráz hossza 2 méter.', 10, 'Forgalmazó', 'imgs/productPhotos/poraz7.jpg', 'leash'),
(28, 'Piros Bőr Póráz', 3300, 'Stílus és funkcionalitás találkozik a Piros Bőr Pórázon! Ez a prémium minőségű póráz nemcsak élénk piros színével tűnik ki, hanem erős, idővel szépülő bőrből készült. Az ergonomikus fogantyú kényelmes fogást biztosít, míg a masszív fém csat garantálja a biztonságot. A tartós és rugalmas anyagok ideálisak a mindennapi sétákhoz. Kombinálja a stílust és a megbízhatóságot ezzel a piros bőr pórázzal, hogy kutyájával való séták még élvezetesebbek legyenek!\r\nA póráz hossza 2 méter.', 10, 'Forgalmazó', 'imgs/productPhotos/poraz8.jpg', 'leash'),
(29, 'Kék Bőr Póráz', 3300, 'Engedje, hogy kutyája is stílusos legyen a Kék Bőr Pórázzal! A prémium minőségű, idővel patinásodó kék bőr elegáns megjelenést kölcsönöz. Az ergonomikus kialakítású fogantyú kényelmet biztosít, míg a masszív fém csat és erős varrások tartósságot garantálnak. Ez a póráz ideális választás a mindennapi sétákhoz, ahol a stílus és a funkcionalitás találkozik. Rendezze be kutyáját egy kék bőr pórázzal, és tegye sétáit még élvezetesebbé!\r\nA póráz hossza 2 méter.', 10, 'Forgalmazó', 'imgs/productPhotos/poraz9.jpg', 'leash'),
(30, 'Rózsaszín Póráz', 2800, 'Stílusos sétákhoz válassza a Rózsaszín Pórázt! Ez a divatos póráz nemcsak élénk rózsaszín színével vonzza a tekinteteket, de könnyű és tartós kialakításával is lenyűgözi. Az ergonomikus fogantyú kényelmes fogást biztosít, míg a masszív fém csat gyorsan rögzíti kutyáját. Rugalmas anyagokból készült, ideális mindennapi sétákhoz. Ezzel a pórázzal a stílus és a kényelem harmonikusan egyesül, hogy sétái még élvezetesebbek legyenek!\r\nA póráz hossza 2 méter.', 10, 'Forgalmazó', 'imgs/productPhotos/poraz10.jpg', 'leash'),
(31, 'Szürke - Fehér Pöttyös Póráz', 3200, 'Stílusos sétákhoz válassza a Szürke-Fehér Pöttyös Pórázt! Az elegáns szürke-fehér pöttyök játékosságot kölcsönöznek, míg a tartós anyagok biztosítják a megbízhatóságot. Az ergonomikus fogantyú kényelmes fogást biztosít, és a masszív fém csat gyorsan rögzíti kutyáját. Rugalmas kialakításával ideális választás mindennapi sétákhoz. Fedezze fel a stílus és a funkcionalitás tökéletes egyensúlyát ezzel a szürke-fehér pöttyös pórázzal, hogy sétái még szórakoztatóbbak legyenek!\r\nA póráz hossza 2 méter.', 10, 'Forgalmazó', 'imgs/productPhotos/poraz11.jpg', 'leash'),
(32, 'Virág Mintás Póráz', 3400, 'A Virág Mintás Póráz egy romantikus és kifinomult kiegészítő, amely virágos mintájával színesíti a kutyasétákat. A póráz minőségi anyaga tartós és időjárásálló, így a mindennapi használatnak is könnyedén ellenáll. Az ergonomikus fogantyú kényelmes fogást biztosít, lehetővé téve a könnyű irányítást séták során. Ideális választás minden olyan kutyatulajdonosnak, aki szereti a romantikus és stílusos kiegészítőket. Legyen ez a póráz a kutyád színes és egyedi kiegészítője a következő séták alkalmával!\r\nA póráz hossza 2 méter.', 10, 'Forgalmazó', 'imgs/productPhotos/poraz12.jpg', 'leash'),
(33, 'Barna Bőr Póráz', 3000, 'A Barna Bőr Póráz elegancia és funkcionalitás tökéletes egyensúlyát nyújtja minden kutyatulajdonosnak. Kiváló minőségű barna bőrből készült, ez a póráz nemcsak stílusos kiegészítője kutyád sétájának, hanem strapabíró és tartós is.\nA póráz hossza 2 méter.', 10, 'Forgalmazó', 'imgs/productPhotos/poraz1.jpg', 'leash'),
(34, 'Narancssárga - Fekete Hám', 4900, 'Stílus és biztonság egyesül a Narancssárga - Fekete Hámmal! Ez a vibráló színű, prémium minőségű hám nemcsak feltűnő megjelenést biztosít, hanem kényelmet és tartósságot is garantál. Az állítható pántok lehetővé teszik a tökéletes illeszkedést, míg a masszív fém csat erős és biztonságos rögzítést biztosít. Ideális választás mindennapi sétákhoz és tréningekhez. Kombinálja a látványt és a funkcionalitást ezzel a narancssárga-fekete hámval, hogy kedvence mindig stílusos és biztonságban legyen!', 10, 'Forgalmazó', 'imgs/productPhotos/ham2.jpg', 'harness'),
(35, 'Piros - Fekete Hám', 5100, 'Elegancia és tartósság jellemzi a Piros-Fekete Hámot! Ez a stílusos hám nemcsak feltűnő piros-fekete kombinációjával vonzza a figyelmet, hanem állítható pántjaival is maximális kényelmet nyújt. A masszív fém csat gyorsan és biztonságosan rögzíti a kutyát. Strapabíró anyagokból készült, ideális mindennapi sétákhoz és kiképzéshez. Stílus és funkcionalitás egyesül ebben a piros-fekete hamban, hogy kedvence mindig divatos és kényelmes legyen!', 10, 'Forgalmazó', 'imgs/productPhotos/ham3.jpg', 'harness'),
(36, 'Fekete Gyémánt Kirakásos Hám', 6200, 'Exkluzivitás és stílus találkozik a Fekete Gyémánt Kirakásos Hámmal! Ez a prémium minőségű fekete hám lenyűgöző gyémánt kirakásokkal díszítve, amelyek elegáns megjelenést kölcsönöznek. Az állítható pántok biztosítják az egyedi illeszkedést, míg a masszív fém csat erős rögzítést garantál. Kényelmes viselet mindennapi sétákhoz vagy különleges alkalmakhoz. Legyen stílusos és különleges a Fekete Gyémánt Kirakásos Hámmal!', 10, 'Forgalmazó', 'imgs/productPhotos/ham4.jpg', 'harness'),
