(39, 'Zöld - Fehér Csíkos Hám', 5600, 'Friss és stílusos megjelenés a Zöld - Fehér Csíkos Hámmal! Ez a trendi hám élénk zöld és fehér csíkokkal díszítve, hogy kedvence minden sétán kimagasló legyen. Az állítható pántok biztosítják az egyedi illeszkedést, míg a masszív fém csat gyors és erős rögzítést kínál. Strapabíró anyagokból készült, ideális mindennapi sétákhoz. Legyen divatos és kényelmes a Zöld-Fehér Csíkos Hámmal, amely garantáltan felhívja magára a figyelmet!', 10, 'Forgalmazó', 'imgs/productPhotos/ham7.jpg', 'harness'),
(40, 'Narancssárga Pufi Hám', 5900, 'Stílus és kényelem találkozik a Narancssárga Pufi Hámmal! Ez a különleges hám nemcsak élénk narancssárga színével emelkedik ki, hanem pufi kialakításával is. Az állítható pántok biztosítják a pontos illeszkedést, míg a masszív fém csat gyorsan és biztonságosan rögzíti a kutyát. Kényelmes viselet minden sétához, a pufi kialakítás pedig extra dizájnt ad. Legyen a kutyája a divat legújabb sztárja a Narancssárga Pufi Hámmal!', 10, 'Forgalmazó', 'imgs/productPhotos/ham8.jpg', 'harness'),
