(42, 'Piros - Fekete Hám', 5600, '\r\nElegancia és kontrasztok találkozása a Piros-Fekete Hámmal! Ez a stílusos hám nemcsak élénk piros és fekete színeivel tűnik ki, hanem állítható pántjaival is maximális kényelmet nyújt. A masszív fém csat biztosítja a gyors és erős rögzítést. Strapabíró anyagokból készült, ideális mindennapi sétákhoz és tréningekhez. Legyen divatos és biztonságos a Piros-Fekete Hámmal, amely egyesíti a látványt és a funkcionalitást!', 10, 'Forgalmazó', 'imgs/productPhotos/ham10.jpg', 'harness'),
(43, 'Fekete - Narancssárga Hám', 5000, 'A Fekete-Narancssárga Kutyahám egy modern és feltűnő kiegészítő a kutyád számára. Kialakításának köszönhetően nemcsak stílusos, hanem kényelmes is viselni. A fekete és narancssárga színek kombinációja harmonikus és látható megjelenést biztosít, miközben az állítható pántok lehetővé teszik a tökéletes illeszkedést. Az erős csatok és hevederek biztosítják a hám stabil rögzítését, így a kutyád biztonságban és kényelemben élvezheti a sétákat. A reflektív elemek növelik a láthatóságot sötét körülmények között, hozzájárulva a kutyád és a sétálók biztonságához.', 10, 'Forgalmazó', 'imgs/productPhotos/ham1.jpg', 'harness'),
(44, 'Piros - Virágos Hám', 5200, 'Élénk stílus és természetes elegancia találkozik a Piros - Virágos Hámmal! Ez a különleges hám nemcsak feltűnő piros színével ragyog, hanem virágos mintáival is feldobja a megjelenést. Az állítható pántok biztosítják az egyedi illeszkedést, míg a masszív fém csat erős rögzítést biztosít. Kényelmes viselet mindennapi sétákhoz, a virágos design pedig egyedivé teszi. Legyen stílusos és különleges a Piros Virágos Hámmal, hogy kedvence minden sétán egyedi legyen!', 10, 'Forgalmazó', 'imgs/productPhotos/ham11.jpg', 'harness'),
(45, 'Szürke - Csillagos Hám', 5400, 'Elegáns és varázslatos sétákhoz válassza a Szürke - Csillagos Hámot! Ez a stílusos hám nemcsak nyugodt szürke színével emelkedik ki, hanem csillagos díszítéseivel is lenyűgözi. Az állítható pántok biztosítják az egyedi illeszkedést, míg a masszív fém csat erős rögzítést kínál. Kényelmes viselet mindennapi sétákhoz, a csillagos design pedig varázslatot kölcsönöz. Legyen a kutyája a stílus és a csillogás középpontjában a Szürke - Csillagos Hámmal!', 10, 'Forgalmazó', 'imgs/productPhotos/ham12.jpg', 'harness'),
(46, 'Virágos Hám', 5100, 'Stílusos sétákhoz válassza a Virágos Hámot! Ez a gyönyörű hám virágos mintájával frissességet és eleganciát kölcsönöz kedvencének. Az állítható pántok biztosítják az egyedi illeszkedést, míg a masszív fém csat gyors és biztonságos rögzítést biztosít. Kényelmes és tartós anyagokból készült, ideális választás mindennapi sétákhoz és kiképzéshez. Legyen a kutyája stílusos és kifinomult a Virágos Hámmal, amely a természet szépségét ötvözi a kényelemmel!', 10, 'Forgalmazó', 'imgs/productPhotos/ham13.jpg', 'harness'),
(47, 'Narancssárga - Fekete Bőr Hám', 5600, 'Stílus és tartósság egyesül a Narancssárga-Fekete Bőr Hámban! Ez a kifinomult hám nemcsak élénk narancssárga és fekete színeivel emelkedik ki, hanem prémium minőségű bőr anyagával is lenyűgözi. Az állítható pántok biztosítják az egyedi illeszkedést, míg a masszív fém csat erős rögzítést nyújt. Kényelmes viselet a mindennapi sétákhoz, a bőr pedig idővel még szebb lesz. Legyen a kutyája a divat és a tartósság ikonja a Narancssárga-Fekete Bőr Hámmal!', 10, 'Forgalmazó', 'imgs/productPhotos/ham14.jpg', 'harness'),
(48, 'Rózsaszín Hám', 4800, 'Stílusos sétákhoz válassza a Rózsaszín Hámot! Ez a bájos hám nemcsak lágy rózsaszín színével hívja fel magára a figyelmet, hanem kényelmes és állítható pántjaival is kiemelkedik. A masszív fém csat biztosítja a gyors és biztonságos rögzítést. Könnyű és tartós anyagokból készült, ideális választás mindennapi sétákhoz. Legyen a kutyája stílusos és kényelmes a Rózsaszín Hámmal, amely a szépséget és funkcionalitást tökéletesen kombinálja!', 10, 'Forgalmazó', 'imgs/productPhotos/ham15.jpg', 'harness'),
