(50, 'Fekete Bőr Hám', 5500, 'Időtlen elegancia a Fekete Bőr Hámmal! Ez a kifinomult hám a klasszikus fekete színével és prémium minőségű bőr anyagával kiemelkedik. Az állítható pántok lehetővé teszik az egyedi illeszkedést, míg a masszív fém csat biztosítja a stabil rögzítést. Kényelmes viselet mindennapi sétákhoz, és a bőr idővel még szebbé válik. Legyen a kutyája stílusos és elegáns a Fekete Bőr Hámmal, ami örök divatot képvisel!', 10, 'Forgalmazó', 'imgs/productPhotos/ham17.jpg', 'harness'),
