(52, 'Világos Barna Bőr Hám', 5500, 'Stílus és kényelem találkoznak a világos barna bőr kutyahámmal! Ez az elegáns hám kiemeli kutyája egyediségét a világosbarna bőr luxusával. Az állítható pántok optimális illeszkedést biztosítanak minden méretű kutya számára. A masszív fémcsat gyorsan és biztonságosan rögzíti. A bőr anyag tartósságot kölcsönöz és idővel még szebb lesz. Ideális mindennapi sétákhoz és kiemelkedő stílust kölcsönöz. Kényeztesse kutyáját a stílusos megjelenéssel és Ön is élvezze a könnyű használatot és tartósságot!', 10, 'Forgalmazó', 'imgs/productPhotos/ham19.jpg', 'harness'),
