(63, 'Sötétkék Bőr Hám', 6000, 'Elegancia és funkcionalitás találkozik a Sötétkék Bőr Hámmal! Ez a stílusos hám tökéletes választás mindennapi sétákhoz és tréningekhez. A mély sötétkék szín luxust és egyediséget kölcsönöz, míg az erős bőr anyagok optimális tartást biztosítanak. Könnyen állítható pántoknak köszönhetően minden kutya számára tökéletes illeszkedést biztosít. Az elülső csat gyorsan rögzíti a hámat, és a bőr idővel csak szebb lesz. Stílus és kényelem találkozik ebben a kifinomult hámban, amely ideális választás azoknak, akik értékelik a minőséget és a divatot. Kényeztesse kutyáját és emelje ki stílusát ezzel a söt', 10, 'Forgalmazó', 'imgs/productPhotos/ham30.jpg', 'harness'),
(64, 'Piros-Fekete Hám', 5000, 'Stílusos Piros-Fekete Hámmal emelje ki kutyáját! Ez a modern hám ideális választás mindennapi sétákhoz és tréningekhez. Az élénk piros és fekete kombinációja dinamikus megjelenést kölcsönöz, miközben az erős anyagok optimális tartást biztosítanak. Az állítható pántok könnyen illeszkednek minden méretű kutya nyakához, és az elülső csat gyorsan rögzíti a hámat. Kényelmes viselet, időjárásálló anyagok és modern design teszik ezt a hámat divatos és funkcionális választássá. Tegye kutyáját divatos központtá ezzel a Piros-Fekete Hámmal, és élvezze a sétákat stílusban!', 10, 'Forgalmazó', 'imgs/productPhotos/ham31.jpg', 'harness'),
(65, 'Barna-Fekete Glitteres Hám', 5600, 'Elegancia és csillogás találkozik a Barna-Fekete Glitteres Hámmal! Ez a divatos hám tökéletes választás mindennapi sétákhoz és különleges alkalmakhoz. A barna és fekete színek kombinációja modern és stílusos megjelenést kölcsönöz, míg a csillogó részletek ragyogást adnak. Az állítható pántok biztosítják a tökéletes illeszkedést minden kutya nyakához. Az elülső csat könnyen és gyorsan rögzíti a hámat. Az erős anyagok és a kifinomult design teszik ezt a hámat időtálló és elegáns választássá. Emelje ki kutyájának egyediségét ezzel a Barna-Fekete Glitteres Hámmal, és tegye sétáit stílusos élménnyé', 10, 'Forgalmazó', 'imgs/productPhotos/ham32.jpg', 'harness'),
(66, 'Piros Glitteres Hám', 5500, 'Fényesség és stílus a Piros Glitteres Hámmal! Ez a különleges hám tökéletes választás mindennapi sétákhoz és különleges alkalmakhoz. A vibráló piros szín és a csillogó részletek egyedi megjelenést kölcsönöznek kutyájának. Az állítható pántoknak köszönhetően könnyen illeszkedik minden kutya nyakához, és az elülső csat gyorsan rögzíti a hámat. Az erős anyagok és a divatos design garantálják a tartósságot és stílust. Legyen kutyája divatos központ ezzel a Piros Glitteres Hámmal, és élvezze a sétákat a különleges fényességben!', 10, 'Forgalmazó', 'imgs/productPhotos/ham33.jpg', 'harness'),
(67, 'Szürke Kényelem', 5300, 'Ismerje meg a \"Szürke Kényelem\" nevű hámat! Ez a stílusos és kényelmes választás mindennapi sétákhoz. A szürke szín eleganciát sugároz, miközben az állítható pántoknak köszönhetően tökéletesen illeszkedik minden kutya nyakához. Az elülső csat könnyen kezelhető, biztosítva a gyors és biztonságos rögzítést. Az erős anyagok garantálják a tartósságot, így ez a hám időtálló és praktikus kiegészítővé válik. Tegye kutyáját kényelmesen és stílusosan sétáltatva a Szürke Kényelem Hám segítségével!', 10, 'Forgalmazó', 'imgs/productPhotos/ham34.jpg', 'harness'),
(68, 'Kakaó Barna Hám', 5800, '\r\nFedezze fel a Kakaó Barna Hámot! Ez a kifinomult és stílusos kiegészítő tökéletes választás mindennapi sétákhoz és kalandokhoz. A kakaó barna szín eleganciát és melegséget sugároz, miközben az állítható pántok biztosítják az optimális illeszkedést. Az elülső csat könnyen kezelhető, és az erős anyagok tartósságot biztosítanak. Időjárásálló kialakítása ideális minden időjárási körülményhez. Kényeztesse kutyáját ezzel a kakaó barna hámmal, és tegye stílusosabbá sétáit!', 10, 'Forgalmazó', 'imgs/productPhotos/ham35.jpg', 'harness'),
(69, 'Vörös Elegancia Hám', 6000, 'Kövesse kutyáját a Vörös Elegancia Hám segítségével! Ez a színvonalas kiegészítő nemcsak stílusos, de kényelmes is mindennapi sétákhoz és kalandokhoz. A vibráló vörös szín kiemeli kutyája egyediségét, miközben az állítható pántoknak köszönhetően tökéletesen illeszkedik. Az elülső csat gyorsan rögzíti a hámat, és az erős anyagok biztosítják a tartósságot. Időjárásálló kialakítása ideális minden időjárási körülményhez. Adjön hozzá stílust sétáihoz ezzel a Vörös Elegancia Hámmal, és élvezze a kényelmet és a divatot egyarán', 10, 'Forgalmazó', 'imgs/productPhotos/ham36.jpg', 'harness'),
(70, 'Fehér Glitteres Hám', 5900, 'Ragyogjon ki a Fehér Glitteres Hámmal! Ez a kifinomult kiegészítő nemcsak stílusos, de kényelmes is mindennapi sétákhoz és tréningekhez. A fehér szín tisztaságot és eleganciát sugároz, miközben a csillogó részletek extra bájt kölcsönöznek. Az állítható pántoknak köszönhetően könnyedén illeszkedik minden kutya nyakához. Az elülső csat gyorsan rögzíti a hámat, és az erős anyagok tartósságot biztosítanak. Ez a fehér glitteres hám nemcsak divatos, de praktikus is, hiszen időjárásálló és könnyen kezelhető. Tegye kutyáját különlegessé ezzel a Fehér Glitteres Hámmal, és élvezze a sétákat stílusban', 10, 'Forgalmazó', 'imgs/productPhotos/ham37.jpg', 'harness'),
(71, 'Barbi Rózsaszín Hám', 5500, 'Színesítse kutyája napját a Barbi Rózsaszín Hámmal! Ez a vidám és kényelmes kiegészítő ideális választás mindennapi sétákhoz. A Barbi rózsaszín színe vidámságot és egyediséget kölcsönöz, miközben az állítható pántok biztosítják az optimális illeszkedést. Az elülső csat gyorsan rögzíti a hámat, és az erős anyagok tartósságot biztosítanak. Ez a Barbi rózsaszín hám nemcsak divatos, de praktikus is, hiszen időjárásálló és könnyen kezelhető. Tegye kutyáját stílusos központtá ezzel a Barbi Rózsaszín Hámmal, és élvezze a sétákat örömökkel és kényelemmel!', 10, 'Forgalmazó', 'imgs/productPhotos/ham38.jpg', 'harness'),
(72, 'Fekete Bőr Hám', 6100, 'Fedezze fel a Fekete Bőr Hámot! Ez a kifinomult kiegészítő ideális választás mindennapi sétákhoz és kalandokhoz. A fekete szín időtálló eleganciát sugároz, miközben az állítható pántok biztosítják az optimális illeszkedést. Az elülső csat gyorsan rögzíti a hámat, és a strapabíró bőr anyagok hosszú élettartamot biztosítanak. Időjárásálló kialakítása segít megőrizni a hám szépségét minden időjárási körülmény között. A Fekete Bőr Hám elegáns megjelenést kölcsönöz kutyájának, miközben kényelmes és praktikus viseletet biztosít. Tegye stílusossá sétáit ezzel a fekete bőr hámmal!', 10, 'Forgalmazó', 'imgs/productPhotos/ham39.jpg', 'harness'),
(73, 'Szürke Hámot Fehér Csíkokkal', 5700, 'Fedezze fel a Stílusos Szürke Hámot fehér csíkokkal! Ez a modern kiegészítő nemcsak divatos, de kényelmes is mindennapi sétákhoz. A szürke szín eleganciát sugároz, a fehér csíkok pedig játékosságot és egyediséget kölcsönöznek. Az állítható pántok biztosítják a tökéletes illeszkedést, és az elülső csat gyorsan rögzíti a hámat. Az erős anyagok tartósságot garantálnak, és az időjárásálló kialakítás minden időjárási körülményhez alkalmazkodik. Kényeztesse kutyáját és tegye stílusossá sétáit ezzel a Szürke Hámmal fehér csíkokkal!', 10, 'Forgalmazó', 'imgs/productPhotos/ham40.jpg', 'harness'),
(74, 'Nyárias Fekete Hám', 5000, 'Ismerje meg a Nyárias Fekete Hámot! Ez a könnyed és stílusos kiegészítő tökéletes választás a melegebb hónapokra. A fekete szín időtálló eleganciát kölcsönöz, miközben a hám könnyed és lenge anyaga kényelmes viseletet biztosít. Az állítható pántoknak köszönhetően könnyedén illeszkedik minden kutya nyakához, és az elülső csat gyorsan rögzíti a hámat. A lélegző anyagok és a nyárias kialakítás teszik ezt a fekete hámat ideális választássá a meleg napokra. Tegye kutyáját kényelembe és stílusba ezzel a Nyárias Fekete Hámmal!', 10, 'Forgalmazó', 'imgs/productPhotos/ham41.jpg', 'harness'),
(75, 'Vidám Sárga-Fekete Hám', 5100, 'Fokozza a kutyasétáltatás élményét a Vidám Sárga-Fekete Hámmal! Ez a stílusos kiegészítő nemcsak divatos, de kényelmes is mindennapi sétákhoz. A vidám sárga és fekete kombinációja energiát és játékosságot kölcsönöz, miközben az állítható pántok biztosítják az optimális illeszkedést. Az elülső csat gyorsan rögzíti a hámat, és az erős anyagok tartósságot biztosítanak. Időjárásálló kialakítása a változékony időjárási körülményekhez is alkalmazkodik. Tegye kutyáját divatossá és kényelmessé ezzel a Vidám Sárga-Fekete Hámmal, és élvezze a sétákat stílusban!', 10, 'Forgalmazó', 'imgs/productPhotos/ham42.jpg', 'harness'),
(76, 'Kényelmes Szürke Túra Hám', 5600, 'Fedezze fel a Kényelmes Szürke Túra Hámot! Ez a könnyed és strapabíró kiegészítő ideális választás kalandos sétákhoz. A szürke szín időtálló eleganciát kölcsönöz, míg a túra hám kialakítása kényelmes és funkcionális. Az állítható pántok biztosítják a tökéletes illeszkedést, és az elülső csat gyorsan rögzíti a hámat. Az erős anyagok tartósságot garantálnak, és az időjárásálló kialakítás minden időjárási körülményhez alkalmazkodik. Tegye kutyáját kényelmesen és stílusosan túrázva a Szürke Túra Hámmal!', 10, 'Forgalmazó', 'imgs/productPhotos/ham43.jpg', 'harness'),
(77, 'Fekete-Szürke Sport Hám', 5400, 'Induljon stílusosan sportos kalandokra a Fekete-Szürke Sport Hámmal! Ez a dinamikus kiegészítő tökéletes választás mindennapi sétákhoz és sportos tevékenységekhez. A fekete-szürke színkombináció modern és sportos megjelenést kölcsönöz, miközben az állítható pántok biztosítják az optimális illeszkedést. Az elülső csat gyorsan rögzíti a hámat, és az erős anyagok tartósságot garantálnak. Kényelmes viselet és időjárásálló kialakítás teszi ezt a hámat ideális választássá minden sportos kutyatulajdonosnak. Tegye kutyáját stílusosan és kényelmesen mozgásba ezzel a Sportos Fekete-Szürke Hámmal!', 10, 'Forgalmazó', 'imgs/productPhotos/ham44.jpg', 'harness'),
(78, 'Sportos Barna Glitteres Hám', 5000, 'Ragyogjon ki a Sportos Glitteres Hámmal, amely stílust és csillogást kölcsönöz minden sétának! A szürke, barna és fekete színek harmonikus kombinációja modern és divatos megjelenést biztosít. Az állítható pántoknak köszönhetően könnyen illeszkedik minden kutya nyakához, és az elülső csat gyorsan rögzíti a hámat. Az erős anyagok és a glitteres részletek a tartósságot és az egyedi stílust garantálják. Ez a Sportos Glitteres Hám nemcsak a kutyáját kényezteti, hanem Önnek is lehetőséget ad a séták során való kitűnésre. Legyen a kutyasétáltatás egyedi és csillogó élmény ezzel a stílusos hámmal!', 10, 'Forgalmazó', 'imgs/productPhotos/ham45.jpg', 'harness'),
(79, 'Sportos Fekete Hám', 5000, 'Induljon stílusos sétákra a Sportos Fekete Hámmal! Ez a dinamikus kiegészítő ideális választás mindennapi tevékenységekhez és sportos kalandokhoz. A fekete szín időtálló és stílusos, míg a sportos kialakítás kényelmes viseletet biztosít. Az állítható pántoknak köszönhetően könnyen illeszkedik minden kutya nyakához, és az elülső csat gyorsan rögzíti a hámat. Az erős anyagok tartósságot garantálnak, és a kényelmes kialakítás egész napos viselést tesz lehetővé. Tegye kutyáját kényelmesen és stílusosan mozgásba a Sportos Fekete Hámmal!', 10, 'Forgalmazó', 'imgs/productPhotos/ham46.jpg', 'harness'),
(80, 'Sportos Fekete Glitteres Hám', 5200, 'Induljon stílusos sétákra a Sportos Fekete-Szürke Glitteres Hámmal! Ez a dinamikus kiegészítő ideális választás mindennapi tevékenységekhez és sportos kalandokhoz. A fekete-szürke színkombináció modern és sportos megjelenést kölcsönöz, a glitteres részletek pedig csillogást adnak. Az állítható pántoknak köszönhetően könnyen illeszkedik minden kutya nyakához, és az elülső csat gyorsan rögzíti a hámat. Az erős anyagok tartósságot garantálnak, és a kényelmes kialakítás egész napos viselést tesz lehetővé. Tegye kutyáját kényelmesen és stílusosan mozgásba ezzel a Sportos Fekete-Szürke Glitteres Hám', 10, 'Forgalmazó', 'imgs/productPhotos/ham47.jpg', 'harness'),
(81, 'Fehér Pöttyös Fekete Hám', 5400, 'Stílusos sétákhoz válassza a Fehér Pöttyös Fekete Hámot! Ez a kifinomult kiegészítő elegáns és játékos megjelenést kölcsönöz kutyájának. A fekete szín időtálló és stílusos, a fehér pöttyök pedig játékosságot és egyediséget sugároznak. Az állítható pántok biztosítják az optimális illeszkedést, és az elülső csat gyorsan rögzíti a hámat. Az erős anyagok és a gondosan kiválasztott részletek garantálják a tartósságot és az egyedi megjelenést. Ez a Fehér Pöttyös Fekete Hám nemcsak divatos, de praktikus is a mindennapi sétákhoz. Tegye kutyáját stílusosan kényelmesen és élvezze a sétákat a divatos hám', 10, 'Forgalmazó', 'imgs/productPhotos/ham48.jpg', 'harness'),
(82, 'Vidám Sárga-Fekete Csíkos Hám', 5300, 'Fedezze fel a Vidám Sárga-Fekete Csíkos Hámot! Ez a kifinomult kiegészítő ideális választás, ha stílust és élénkséget szeretne a kutyasétáltatáshoz. A sárga és fekete csíkok kombinációja modern és játékos megjelenést kölcsönöz. Az állítható pántoknak köszönhetően könnyedén illeszkedik minden kutya nyakához, és az elülső csat gyorsan rögzíti a hámat. Az erős anyagok tartósságot garantálnak, és az időjárásálló kialakítás minden időjárási körülményhez alkalmazkodik. Tegye kutyáját stílusosan és kényelmesen mozgásba ezzel a Vidám Sárga-Fekete Csíkos Hámmal!', 10, 'Forgalmazó', 'imgs/productPhotos/ham49.jpg', 'harness'),
(83, 'Fehér Fekete Pöttyös Hám', 5400, 'Stílusos sétákhoz válassza a Fehér Fekete Pöttyös Hámot! Ez a kifinomult kiegészítő elegáns és játékos megjelenést kölcsönöz kutyájának. A fehér alap és a fekete pöttyök kombinációja időtálló és stílusos. Az állítható pántok biztosítják az optimális illeszkedést, és az elülső csat gyorsan rögzíti a hámat. Az erős anyagok és a gondosan kiválasztott részletek garantálják a tartósságot és az egyedi megjelenést. Ez a Fehér Fekete Pöttyös Hám nemcsak divatos, de praktikus is a mindennapi sétákhoz. Tegye kutyáját stílusosan kényelmesen és élvezze a sétákat a divatos pöttyös hámjával!', 10, 'Forgalmazó', 'imgs/productPhotos/ham50.jpg', 'harness'),
(84, 'Fekete Hám Sárga Övvel', 5500, 'Stílusos sétákhoz válassza a Fekete Hámot Sárga Övvel! Ez a modern kiegészítő ideális választás mindennapi sétákhoz és edzésekhez. A fekete szín időtálló eleganciát sugároz, a sárga öv pedig játékosságot kölcsönöz. Az állítható pántok biztosítják az optimális illeszkedést, és az elülső csat gyorsan rögzíti a hámat. Az erős anyagok tartósságot garantálnak, és a stílusos sárga öv emeli ki a kutyája egyediségét. Praktikus és divatos választás a Fekete Hám Sárga Övvel, hogy sétái még stílusosabbak legyenek!', 10, 'Forgalmazó', 'imgs/productPhotos/ham51.jpg', 'harness'),
(85, 'Szürke-Fekete Nylon Hám', 5200, 'Fedezze fel a Stílusos Szürke-Fekete Nylon Hámot! Ez a könnyű és tartós kiegészítő ideális választás mindennapi sétákhoz. A szürke-fekete színkombináció modern és időtálló megjelenést kölcsönöz. A nylon anyag erős és időjárásálló, biztosítva a kényelmes és biztonságos viseletet. Az állítható pántoknak köszönhetően könnyen illeszkedik minden kutya nyakához, és az elülső csat gyorsan rögzíti a hámat. Stílus és funkcionalitás találkozik ebben a Szürke-Fekete Nylon Hámban, hogy sétái még kellemesebbek és divatosabbak legyenek!', 10, 'Forgalmazó', 'imgs/productPhotos/ham52.jpg', 'harness'),
(86, 'Egyszerű Fekete Sport Hám', 5000, 'Induljon sportos sétákra az Egyszerű Fekete Sport Hámmal! Könnyű, de tartós kialakítású, ideális mindennapi tevékenységekhez. Az egyszínű fekete stílusos és időtálló, míg az egyszerű kialakítás kényelmes viseletet biztosít. Az állítható pántok segítenek az optimális illeszkedés elérésében, és az elülső csat gyorsan rögzíti a hámat. Erős anyagokból készült a tartósság érdekében. Az Egyszerű Sportos Fekete Hám ideális választás a kényelmes és stílusos sétákhoz.', 10, 'Forgalmazó', 'imgs/productPhotos/ham53.jpg', 'harness'),
(87, 'Egyszerű Szürke Szövet Hám', 5100, 'Fedezze fel az Egyszerű Szürke Szövet Hámot! Ez a könnyű és kényelmes kiegészítő ideális választás mindennapi sétákhoz. A szürke szín egyszerű és időtálló, míg a szövet anyag légáteresztő és kényelmes viseletet biztosít. Az állítható pántoknak köszönhetően könnyedén illeszkedik minden kutya nyakához, és az elülső csat gyorsan rögzíti a hámat. Az egyszerű kialakítás ellenére erős anyagokból készült, hogy biztosítsa a tartósságot és a kényelmet. Az Egyszerű Szürke Szövet Hám ideális választás a relaxált és stílusos sétákhoz.', 10, 'Forgalmazó', 'imgs/productPhotos/ham54.jpg', 'harness'),
(88, 'Sportos Szürke Szövet Hám', 5000, 'Induljon sportos sétákra a Sportos Szürke Szövet Hámmal! Ez a modern kiegészítő ideális választás aktív kutyák számára. A szürke szövet stílusos és időtálló, míg a sportos kialakítás kényelmes és mozgásbarát viseletet biztosít. Az állítható pántoknak köszönhetően könnyen illeszkedik minden kutya nyakához, és az elülső csat gyorsan rögzíti a hámat. A tartós anyagok és a lélegző szövet segítenek a kutyájának kényelmesen maradni minden tevékenység során. A Sportos Szürke Szövet Hám a stílus és a funkcionalitás tökéletes egyensúlyát kínálja a dinamikus kutyatulajdonosoknak!', 10, 'Forgalmazó', 'imgs/productPhotos/ham55.jpg', 'harness'),
(89, 'Fekete Poliészter Hám', 5500, 'Fedezze fel a Fekete Poliészter Hámot! Ez a könnyű és tartós kiegészítő ideális választás mindennapi sétákhoz. A fekete poliészter anyag modern és időtálló, kényelmes viseletet biztosítva. Az állítható pántoknak köszönhetően könnyen illeszkedik minden kutya nyakához, és az elülső csat gyorsan rögzíti a hámat. A poliészter anyag erős és időjárásálló, így a hám tartósságát is biztosítja. Ez a Fekete Poliészter Hám praktikus és stílusos választás, hogy kutyájával stílusosan és kényelmesen sétálhasson!', 10, 'Forgalmazó', 'imgs/productPhotos/ham56.jpg', 'harness');
