(96, 'Sárga Hám Fekete Pöttyökkel', 5200, 'Sétáljon stílusosan a Sárga Hámmal, melyet szórakoztató Fekete Pöttyök tesznek még egyedibbé! Ez a könnyű és tartós kiegészítő ideális választás mindennapi sétákhoz. A sárga alapvidám és energikus, a fekete pöttyök pedig játékosságot kölcsönöznek. Az állítható pántok biztosítják az optimális illeszkedést, és az elülső csat gyorsan rögzíti a hámat. A tartós anyagok garantálják a hosszú élettartamot, miközben a kényelmes viseletért felelnek. Ez a Sárga Hám Fekete Pöttyökkel divatos és funkcionális választás, hogy kutyájával együtt élvezhesse a sétákat!', 10, 'Forgalmazó', 'imgs/productPhotos/ham63.jpg', 'harness'),
(97, 'Barna Nylon Hám', 5200, 'Válassza a kényelmes és strapabíró Barna Nylon Hámot kutyájának! Ez a könnyű kiegészítő ideális választás mindennapi sétákhoz. A barna szín időtálló és elegáns, a strapabíró nylon anyag pedig garantálja a tartósságot. Az állítható pántoknak köszönhetően könnyen illeszkedik minden kutya nyakához, és az elülső csat gyorsan rögzíti a hámat. A Nylon Hám kényelmes viseletet biztosít, és időjárásálló anyaga hosszú élettartamot garantál. Egyszerűen stílusos és funkcionális választás a mindennapi sétákhoz!', 10, 'Forgalmazó', 'imgs/productPhotos/ham64.jpg', 'harness'),
(98, 'Fekete Poliészter és Bőr Hám', 5900, 'Induljon stílusos sétákra a Fekete Poliészter és Bőr Hámmal! Ez a kettős anyagú kiegészítő ideális választás mindennapi tevékenységekhez. A fekete poliészter modern és időtálló, míg a bőr rész elegáns és strapabíró. Az állítható pántok biztosítják az optimális illeszkedést, és az elülső csat gyorsan rögzíti a hámat. A kombinált anyagok garantálják a tartósságot és a kényelmes viseletet. Ez a Fekete Poliészter és Bőr Hám egyedi és stílusos választás, hogy kutyájával együtt élvezhesse a sétákat!', 10, 'Forgalmazó', 'imgs/productPhotos/ham65.jpg', 'harness'),
(99, 'Fekete Szövet Hám', 5300, 'Induljon stílusos sétákra a Fekete Szövet Hámmal! Ez a könnyű és kényelmes kiegészítő ideális választás mindennapi sétákhoz. A fekete szövet egyszerű, mégis időtálló, és a könnyű anyag biztosítja a kényelmes viseletet. Az állítható pántoknak köszönhetően könnyen illeszkedik minden kutya nyakához, és az elülső csat gyorsan rögzíti a hámat. A Fekete Szövet Hám stílusos és funkcionális választás, hogy kutyájával együtt élvezhesse a sétákat!', 10, 'Forgalmazó', 'imgs/productPhotos/ham66.jpg', 'harness'),
(100, 'Piros Szövet Hám', 5100, 'Ragyogjon stílusával a Piros Szövet Hámmal! Ez a könnyű és kényelmes kiegészítő ideális választás mindennapi sétákhoz. A piros szövet vibráló és élénk, a könnyű anyag pedig biztosítja a kényelmes viseletet. Az állítható pántoknak köszönhetően könnyen illeszkedik minden kutya nyakához, és az elülső csat gyorsan rögzíti a hámat. A Piros Szövet Hám stílusos és funkcionális választás, hogy kutyájával együtt élvezhesse a sétákat!', 10, 'Forgalmazó', 'imgs/productPhotos/ham67.jpg', 'harness'),
(101, 'Fekete Nylon Hám Piros Övvel', 5500, 'Válassza a stílust és kényelmet a Fekete Nylon Hámmal Piros Övvel! Ez a könnyű és strapabíró kiegészítő ideális választás mindennapi sétákhoz. A fekete szín időtálló és modern, a piros öv pedig hangsúlyozza a kutyahám egyediségét. Az állítható pántoknak köszönhetően könnyen illeszkedik minden kutya nyakához, és az elülső csat gyorsan rögzíti a hámat. A Nylon Hám Piros Övvel tartós és időjárásálló, így hosszú élettartamot biztosít. Ez a kombináció divatos és funkcionális választás, hogy kutyájával együtt élvezhesse a sétákat!', 10, 'Forgalmazó', 'imgs/productPhotos/ham68.jpg', 'harness'),
(102, 'Fekete Szövet Hám', 5100, 'Elegánsan sétáljon a Fekete Szövet Hámmal! Ez a könnyű és kényelmes kiegészítő ideális választás mindennapi sétákhoz. A fekete szövet időtálló és stílusos, a könnyű anyag pedig biztosítja a kényelmes viseletet. Az állítható pántoknak köszönhetően könnyen illeszkedik minden kutya nyakához, és az elülső csat gyorsan rögzíti a hámat. A Fekete Szövet Hám egyszerű és időtálló választás, hogy kutyájával együtt élvezhesse a sétákat!', 10, 'Forgalmazó', 'imgs/productPhotos/ham69.jpg', 'harness'),
(103, 'Rózsaszín Hám Fehér Pöttyökkel', 6100, 'Kényeztesse kedvencét a Rózsaszín Hámmal, melyet bájos Fehér Pöttyök tesznek még szebbé! Ez a könnyű és stílusos kiegészítő ideális választás mindennapi sétákhoz. A rózsaszín szín édes és élénk, a fehér pöttyök pedig játékos karaktert kölcsönöznek. Az állítható pántoknak köszönhetően könnyen illeszkedik minden kutya nyakához, és az elülső csat gyorsan rögzíti a hámat. A Rózsaszín Hám Fehér Pöttyökkel divatos és praktikus választás, hogy kutyájával együtt élvezhesse a sétákat!\r\n\r\n\r\n\r\n\r\n\r\n', 10, 'Forgalmazó', 'imgs/productPhotos/ham70.jpg', 'harness'),
(104, ' Elegáns Barna Bőr Hám', 6100, 'Válassza az Elegáns Barna Bőr Hámot, és tegye különlegessé kutyájának sétáit! A kényelmes és strapabíró bőr anyagú hám ideális választás mindennapi használatra. Az elegáns barna szín időtálló és stílusos, és az állítható pántok biztosítják az optimális illeszkedést. Az elülső csatnak köszönhetően könnyen fel- és levehető. Az Elegáns Barna Bőr Hám kifinomult megjelenést kölcsönöz kutyájának, miközben biztosítja a kényelmes viseletet séták során.', 10, 'Forgalmazó', 'imgs/productPhotos/ham71.jpg', 'harness'),
(105, 'Elegáns Barna Szövet Hám', 5600, 'Tegye még elegánsabbá kutyájának sétáit az Elegáns Barna Szövet Hámmal! Ez a könnyű és stílusos kiegészítő ideális választás mindennapi sétákhoz. Az elegáns barna szövet időtálló és divatos, a könnyű anyag pedig biztosítja a kényelmes viseletet. Az állítható pántoknak köszönhetően könnyen illeszkedik minden kutya nyakához, és az elülső csat gyorsan rögzíti a hámat. Az Elegáns Barna Szövet Hám egyedülálló stílust kölcsönöz kutyájának, miközben a tartós anyagok biztosítják a megbízhatóságot.', 10, 'Forgalmazó', 'imgs/productPhotos/ham72.jpg', 'harness'),
(106, 'Szürke Díszes Szövet Hám', 5700, 'Stílusos sétákhoz válassza a Szürke Szövet Hámot Fekete Pontokkal! Ez a könnyű és divatos kiegészítő ideális választás mindennapi sétákhoz. A szürke szövet időtálló és modern, a fekete pontok pedig játékos karaktert kölcsönöznek. Az állítható pántoknak köszönhetően könnyen illeszkedik minden kutya nyakához, és az elülső csat gyorsan rögzíti a hámat. A Szürke Szövet Hám Fekete Pontokkal kombinálja a stílust és a kényelmet, hogy kutyájával együtt élvezhesse a sétákat!', 10, 'Forgalmazó', 'imgs/productPhotos/ham73.jpg', 'harness'),
(107, 'Fekete Bőr Hám Sárga Varrattal', 6100, 'Adjon stílust és eleganciát a kutyasétáltatáshoz a Fekete Bőr Hámmal Citromárga Varrattal! Ez a kényelmes és strapabíró hám ideális választás mindennapi sétákhoz. A fekete bőr időtálló és elegáns, a citromárga varrás pedig játékosságot kölcsönöz. Az állítható pántoknak köszönhetően könnyen illeszkedik minden kutya nyakához, és az elülső csat gyorsan rögzíti a hámat. A Fekete Bőr Hám Citromárga Varrattal egyedi stílust ad kutyájának, miközben biztosítja a kényelmes és megbízható viseletet.', 10, 'Forgalmazó', 'imgs/productPhotos/ham74.jpg', 'harness'),
(108, 'Fekete Pöttyös Szövet Hám', 5100, 'Stílusosan sétáltassa kedvencét a Fekete Szövet Hámmal Fehér Pöttyökkel! Ez a könnyű és divatos kiegészítő ideális választás mindennapi sétákhoz. A fekete szövet időtálló és modern, míg a fehér pöttyök játékosságot kölcsönöznek. Az állítható pántoknak köszönhetően könnyen illeszkedik minden kutya nyakához, és az elülső csat gyorsan rögzíti a hámat. A Fekete Szövet Hám Fehér Pöttyökkel kombinálja a stílust és a kényelmet, hogy kutyájával együtt élvezhesse a sétákat!', 10, 'Forgalmazó', 'imgs/productPhotos/ham75.jpg', 'harness'),
(109, 'Piros Hám Fekete Mintával', 5300, 'Egyszerűség és stílus találkozik a Piros Hámmal Fekete Mintával! Ez a könnyű és praktikus kiegészítő ideális választás mindennapi sétákhoz. A piros szín élettel teli és feltűnő, a fekete minta pedig egyedi karaktert kölcsönöz. Az állítható pántoknak köszönhetően könnyen illeszkedik minden kutya nyakához, és az elülső csat gyorsan rögzíti a hámat. Az Egyszerű Piros Hám Fekete Mintával tökéletes választás azoknak, akik szeretnék kiemelni kutyájuk egyediségét a séták során.', 10, 'Forgalmazó', 'imgs/productPhotos/ham76.jpg', 'harness'),
(110, 'Szürke Szövet Hám Piros Kerettel', 5400, 'Adjon egyedi stílust kutyasétáltatásához a Szürke Szövet Hámmal Piros Kerettel! Ez a könnyű és divatos kiegészítő ideális választás mindennapi sétákhoz. A szürke szövet időtálló és modern, a piros keret pedig kiemeli a hám eleganciáját. Az állítható pántoknak köszönhetően könnyen illeszkedik minden kutya nyakához, és az elülső csat gyorsan rögzíti a hámat. A Szürke Szövet Hám Piros Kerettel kombinálja a kényelmet és a stílust, hogy kutyájával együtt élvezhesse a sétákat!', 10, 'Forgalmazó', 'imgs/productPhotos/ham77.jpg', 'harness'),
(111, ' Fekete Nylon Hám Piros Övvel', 5200, 'Dinamizálja kutyasétáltatását a Fekete Nylon Hámmal Piros Övvel! Ez a könnyű és praktikus kiegészítő tökéletes választás mindennapi tevékenységekhez. A fekete hám időtálló és kényelmes, a piros öv pedig lendületet ad neki. Az állítható pántoknak köszönhetően könnyen illeszkedik minden kutya nyakához, és az elülső csat gyorsan rögzíti a hámat. A Fekete Nylon Hám Piros Övvel kombinálja a funkcionalitást és a stílust, hogy kutyájával való séták még élvezetesebbek legyenek!', 10, 'Forgalmazó', 'imgs/productPhotos/ham78.jpg', 'harness'),
(112, 'Fekete Hám Fehér Varratokkal', 5600, 'Elegancia és stílus a Fekete Hámmal Fehér Varratokkal! Ez a könnyű és kifinomult kiegészítő tökéletes választás mindennapi sétákhoz. A fekete hám időtálló és modern, a fehér varratok pedig kiemelik a hám részleteit. Az állítható pántoknak köszönhetően könnyen illeszkedik minden kutya nyakához, és az elülső csat gyorsan rögzíti a hámat. A Fekete Hám Fehér Varratokkal kombinálja az egyszerűséget és az eleganciát, hogy kutyájával való séták igazán különlegesek legyenek!', 10, 'Forgalmazó', 'imgs/productPhotos/ham79.jpg', 'harness'),
(113, 'Sportos Szürke Hám Sárga Övvel', 6000, 'Merítsen ihletet aktív életmódjához a Sportos Szürke Hámmal Sárga Övvel! Ez a könnyű és dinamikus kiegészítő ideális választás mindennapi sétákhoz és edzésekhez. A sportos design és a sárga öv lendületet adnak a hámnak, miközben az állítható pántok biztosítják az optimális illeszkedést. Az elülső csat gyorsan rögzíti a hámat, így készülhetnek az izgalmas kalandok kutyájával. A Sportos Hám Sárga Övvel kombinálja a funkcionalitást és a stílust, hogy minden sétája egy igazi kaland legyen!', 10, 'Forgalmazó', 'imgs/productPhotos/ham80.jpg', 'harness'),
(114, 'Fekete Nylon Hám Sárga Övvel', 5000, 'Stílusos fekete nylon hám sárga övvel ideális választás a kutyájának. Az erős nylon anyag biztosítja a tartósságot, míg a sárga öv stílust és könnyű felismerhetőséget kölcsönöz. A könnyen állítható pántoknak köszönhetően tökéletes illeszkedést nyújt, és a hagyományos fém csat gyorsan rögzíti kutyáját. Ideális mindennapi sétákhoz és edzésekhez, ez a fekete nylon hám stílusos és funkcionális megoldás a kutyatulajdonosok számára!', 10, 'Forgalmazó', 'imgs/productPhotos/ham81.jpg', 'harness'),
(115, 'Fekete Nylon Hám Fekete Övvel', 5300, 'Elegáns fekete nylon hám fekete övvel, amely tökéletes választás a stílusos kutyasétákhoz. Az erős nylon anyag garantálja a tartósságot, míg a fekete öv kiemeli a minimalista eleganciát. A könnyen állítható pántok biztosítják a tökéletes illeszkedést, és a fém csat gyorsan rögzíti kutyáját. Ez a fekete nylon hám praktikus és divatos kiegészítő minden kutyatulajdonos számára, aki értékeli a minőséget és az stílust.', 10, 'Forgalmazó', 'imgs/productPhotos/ham82.jpg', 'harness'),
(116, 'Fekete Hám Virág Mintával', 5700, 'A stílus és a kényelem találkozik ebben az exkluzív termékben. Divatos és strapabíró, tökéletes mindennapi viseletre. A precíz varrások és a tartós anyagok hosszú élettartamot biztosítanak. Legyen Önnek is stílus és kényelem együtt ebben a fekete hám virág mintás kiegészítőbe', 10, 'Forgalmazó', 'imgs/productPhotos/ham83.jpg', 'harness'),
(117, 'Rózsaszín Hám Fekete Kerettel', 5000, 'Stílusos rózsaszín hám fekete kerettel, mely ideális választás a divatos kutyatulajdonosok számára. A könnyű és tartós anyagnak köszönhetően kényelmet nyújt mindennapi sétákhoz. A fekete keret elegáns kontrasztot teremt, kiemelve a kutyája stílusát. Praktikus és divatos megoldás a kényelmes viselethez, amely garantáltan felhívja a figyelmet. Legyen része a divatos kutyatartók közösségének ebben a rózsaszín hám fekete kerettel!', 10, 'Forgalmazó', 'imgs/productPhotos/ham84.jpg', 'harness'),
(118, 'Szürke színű hám vörös kerettel', 6000, 'Szürke színű hám vörös kerettel, az elegancia és stílus tökéletes harmóniáját kínálja ez a kifinomult kiegészítő. A szürke színű hám időtlen és divatos, míg a vörös keret hangsúlyozza az egyediséget. Kényelmes és strapabíró, ideális mindennapi használatra. A pontos varrások és a prémium anyagok biztosítják a hosszú élettartamot. Legyen Ön is részese ennek az exkluzív megjelenésnek, és tegye kutyáját még stílusosabbá ebben a szürke hám vörös kerettel!', 10, 'Forgalmazó', 'imgs/productPhotos/ham85.jpg', 'harness'),
(119, 'Fekete Díszes Szövet Hám', 6000, 'Fekete szövet hám fehér varrattal, elegáns és időtlen választás a kifinomult megjelenés kedvelőinek. A fekete szövet klasszikus, míg a fehér varrások kiemelik az egyediséget. Kényelmes és strapabíró, ideális mindennapi viseletre. A pontos varrások és a prémium anyagok garantálják a hosszú élettartamot. Legyen Önnek is része ennek a stílusos, fekete szövet hámnak fehér varrattal, és tegye kutyáját még elegánsabbá!', 10, 'Forgalmazó', 'imgs/productPhotos/ham86.jpg', 'harness'),
(120, 'Sárga Szövet Hám Fekete Ferettel', 5000, 'Sárga szövet hám fekete kerettel, friss és feltűnő választás azoknak, akik szeretnék kiemelni kutyájuk stílusát. A sárga szövet vidám és vibráló, míg a fekete keret hangsúlyozza az eleganciát. Kényelmes és strapabíró, tökéletes mindennapi sétákhoz. A pontos varrások és a minőségi anyagok biztosítják a hosszú élettartamot. Legyen részese ennek az exkluzív megjelenésnek, és tegye kutyáját még stílusosabbá ebben a sárga szövet hám fekete kerettel!', 10, 'Forgalmazó', 'imgs/productPhotos/ham87.jpg', 'harness'),
(121, 'Piros Nylon Hám Fekete Kerettel', 5100, 'A merész és stílusos választás kutyája számára. A piros szín energiát sugároz, míg a fekete keret elegáns kontrasztot teremt. Könnyen állítható, biztosítva a kényelmet és a tökéletes illeszkedést. A strapabíró nylon anyag és a precíz varrások biztosítják a hosszú élettartamot. Ideális mindennapi sétákhoz és kalandokhoz. Legyen része ennek az exkluzív megjelenésnek, és tegye kutyáját még stílusosabbá ebben a piros nylon hámban fekete kerettel!', 10, 'Forgalmazó', 'imgs/productPhotos/ham88.jpg', 'harness'),
(122, 'Terepmintás Nylon Hám', 5800, 'Terepmintás nylon hám, az ideális választás az aktív kutyáknak. A terepminta stílusos és praktikus, biztosítva a tökéletes beleolvadást a környezetbe. A strapabíró nylon anyag ellenáll az igénybevételnek, míg a pontos varrások garantálják a hosszú élettartamot. Könnyen állítható pántokkal rendelkezik, így biztosítva a kényelmet és a biztonságos illeszkedést. Kiváló választás mindennapi sétákhoz és kalandokhoz a természetben. Legyen részese ennek a terepmintás nylon hámnak, és tegye kutyáját még stílusosabbá és készen állóvá a kalandokra!', 10, 'Forgalmazó', 'imgs/productPhotos/ham89.jpg', 'harness'),
(123, 'Színes Virágos Mintájú Hám', 5400, 'Frissesség és stílus találkozik ebben a kifinomult kiegészítőben. A színes virágok élettel töltik meg a hámot, kifejezve a vidámságot és egyediséget. Kényelmes és könnyű, ideális mindennapi használatra. A strapabíró anyagok és a gondos varrások garantálják a tartósságot. Egyszerűen állítható, így tökéletesen illeszkedik kutyájához. Legyen része ennek az exkluzív megjelenésnek, és tegye kutyáját még színesebbé ebben a virágos mintájú hámban!', 10, 'Forgalmazó', 'imgs/productPhotos/ham90.jpg', 'harness'),
(124, 'Fekete Öves Hám', 5000, 'Fedezze fel a Fekete Öves Hámot, a kiváló minőségű és stílusos öv, amely tökéletes kiegészítője mindennapi viseletének. Az öv fekete öntött fémcsatja kivételesen strapabíró és könnyű, biztosítva ezzel hosszú élettartamát. Az elegáns öv szélessége optimális kényelmet nyújt, és igazi fekete öves külsőt kölcsönöz viselőjének. Kombinálható formális és informális viselettel egyaránt, így az ideális választás minden alkalmazkodási helyzetben. Stílusos megjelenés, kényelem és tartósság egyben - a Fekete Öves Hám a kifinomult stílus szerelmeseinek.', 10, 'Forgalmazó', 'imgs/productPhotos/ham91.jpg', 'harness'),
(125, 'Szürke Öves Hám', 5100, 'Bontsa le a konvenciókat a Szürke Öves Hámmal! Ez a divatos öv nem csupán tartózkodó szürke árnyalatával ragadja meg figyelmét, hanem kifinomult öntött fémcsattal is rendelkezik, amely stílust és tartósságot kölcsönöz. Az öv vékony, mégis erős anyagokból készül, hogy maximális kényelmet és hosszú élettartamot biztosítson. Rugalmasan alkalmazkodik mindennapi viselethez, legyen szó alkalmi vagy formális eseményről. A Szürke Öves Hám egyaránt kihangsúlyozza egy laza nadrág eleganciáját és egy szűk fazonú öltöny stilizált vonalait. Legyen a divat iránytűje a Szürke Öves Hám segítségével, és hagyja', 10, 'Forgalmazó', 'imgs/productPhotos/ham92.jpg', 'harness'),
(126, 'Fekete-Piros Öves Hám', 5200, 'Mutassa meg a stílusát a Fekete-Piros Öves Hámmal! Ez a lenyűgöző öv egyesíti a klasszikus fekete és vibráló piros árnyalatokat, így garantáltan kiemelkedik a tömegből. Az öv masszív öntött fémcsattal rendelkezik, amely nemcsak látványos, hanem tartós is. A széles öv kényelmes viseletet biztosít, miközben hangsúlyozza az Ön egyedi stílusát. Az alkalmi és formális öltözékek tökéletes kiegészítője, amely minden szettet feldobja. Legyen az irányítója a divatnak a Fekete-Piros Öves Hámmal, és hagyja, hogy stílusa beszéljen önért!', 10, 'Forgalmazó', 'imgs/productPhotos/ham93.jpg', 'harness'),
(127, 'Vörös Hám', 5000, 'Merész és kifinomult, a Vörös Hám kihangsúlyozza az egyediségét. Az öv élénk vörös árnyalata azonnal magára vonja a tekintetet, míg a masszív öntött fémcsat stílusos és tartós kiegészítővé teszi. Az öv könnyű és kényelmes viseletet nyújt, alkalmazkodva mindennapi és különleges eseményekhez egyaránt. Kiemeli öltözékét, legyen szó farmerrel vagy elegánsabb viselettel. A Vörös Hám nem csupán egy öv, hanem egy stílusnyilatkozat, amely kifejezi önazonosságát és önbizalmát. Fedezze fel a divat új dimenzióját a Vörös Hámmal!', 10, 'Forgalmazó', 'imgs/productPhotos/ham94.jpg', 'harness'),
(128, 'Rózsás Hám', 5100, 'Színes és nőies, a Rózsás Hám egy lenyűgöző kiegészítő a divatkedvelő nők számára. Az öv finom rózsaszín árnyalata frissességet és romantikát sugároz, miközben a masszív öntött fémcsat stílust kölcsönöz. Könnyű és kényelmes viseletet biztosít, ideális mindennapi szettjeihez vagy különleges alkalmakhoz. A Rózsás Hám hangsúlyozza nőiességét, és egyedivé teszi öltözékét. Legyen az öltözékének színpompás pontja a Rózsás Hámmal, és hagyja, hogy stílusa ragyogjon!', 10, 'Forgalmazó', 'imgs/productPhotos/ham95.jpg', 'harness'),
(129, 'Babarózsaszín Hám', 5300, 'A Babarózsaszín Hám egy csodálatosan szép és kifejezetten nőies kiegészítő a divatvilág szerelmeseinek. Az öv gyengéd babarózsaszín árnyalata romantikus hangulatot kölcsönöz, míg a masszív öntött fémcsat elegáns és tartós részletekkel büszkélkedik. Kényelmes és könnyű viseletének köszönhetően tökéletes választás mindennapi stílusának feldobásához. Legyen szó elegáns ruháról vagy laza farmeres megjelenésről, a Babarózsaszín Hám minden szettet emel egy szinttel. Engedje szabadjára nőiességét a Babarózsaszín Hámmal, és hagyja, hogy stílusa virágba boruljon!', 10, 'Forgalmazó', 'imgs/productPhotos/ham96.jpg', 'harness'),
(130, 'Barna Bőr Hám', 5400, 'A Barna Bőr Hám egy időtlen és stílusos választás azoknak, akik értékelik az eleganciát és a tartósságot. A puha barna bőr magas minőségű és kényelmes viseletet biztosít. A klasszikus öntött fémcsat nemcsak esztétikailag vonzó, hanem megbízható tartósságot is nyújt. Az öv sokoldalúan kombinálható, ideális mindennapi viselethez és alkalmi eseményekhez egyaránt. Egyedi varrásai és kidolgozott részletei kiemelik az öv minőségét. Legyen az Ön stílusának alapdarabja a Barna Bőr Hám, és élvezze a kifinomultságot minden megjelenésében.', 10, 'Forgalmazó', 'imgs/productPhotos/ham97.jpg', 'harness'),
(131, 'Szürke-Fekete Hám', 5200, 'A Szürke-Fekete Hám stílusos és praktikus kiegészítő, amely kiválóan illeszkedik mindennapi életéhez. Készült minőségi anyagokból, strapabíró és könnyen tisztítható. Az elegáns dizájn mellett funkcionális rejtett zsebekkel rendelkezik, ideális társ az okostelefon, kulcsok vagy pénz tárolásához. A divatos és egyedi megjelenésű hám kényelmet és stílust nyújt viselőjének. Legyen része a modern életstílusnak ezzel az egyedülálló termékkel!', 10, 'Forgalmazó', 'imgs/productPhotos/ham98.jpg', 'harness'),
(132, 'Kék-Fehér Csíkos Nyakörv', 3200, 'Hozza ki a legjobbat kutyasétáltatásából a Kék-Fehér Csíkos Nyakörvvel! Ez a könnyű és stílusos kiegészítő tökéletes választás mindennapi sétákhoz. A kék-fehér csíkok játékos karaktert kölcsönöznek, miközben az anyagok biztosítják a tartósságot. Az állítható pántoknak köszönhetően könnyen illeszkedik minden kutya nyakához. A Kék-Fehér Csíkos Nyakörv kombinálja az eleganciát és a funkcionalitást, hogy a séták még élvezetesebbek legyenek kutyájával!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv2.jpg', 'collar'),
(133, 'Superman Mintás Nyakörv', 3500, 'Az ikonikus Superman dizájnnal és vibráló színekkel ez a nyakörv hősként emeli ki kutyáját a mindennapokban. Kényelmes és strapabíró, az állítható pántok biztosítják a tökéletes illeszkedést. A Superman emblémával díszített nyakörv stílust és egyedi megjelenést kölcsönöz kutyájának. Mutassa meg, hogy kutyája is egy kis szuperhős a Superman mintás nyakörvvel!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv3.jpg', 'collar'),
(134, 'Superman Mintás Nyakörv', 3500, 'Kutyája legyen a stílusos szuperhős ebben a különleges nyakörvben. A fodros dizájn és az ikonikus Superman minta egyesül, hogy kifejezze egyediségét és karakterét. A színek és a részletgazdag minta élettel töltik meg ezt a kiegészítőt. Kényelmes viselet a mindennapi sétákhoz, az állítható pántok biztosítják az egyedi illeszkedést. Legyen részese ennek a szuper stílusú és egyedi megjelenésű nyakörvnek, amely kiemeli kutyája egyéniségét!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv4.jpg', 'collar'),
(135, 'Superman Mintás Nyakörv', 3400, 'Kutyája legyen stílusos szuperhős ebben a különleges nyakörvben. A kapcsos dizájn és az ikonikus Superman minta egyesül, kiemelve kutyája egyediségét és karakterét. A színek és a részletgazdag minta élettel töltik meg ezt a kiegészítőt. Kényelmes viselet a mindennapi sétákhoz, az állítható kapcsok lehetővé teszik az egyedi illeszkedést. Legyen részese ennek a szuper stílusú és egyedi megjelenésű nyakörvnek, amely kiemeli kutyája egyéniségét!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv5.jpg', 'collar'),
(136, 'Superman Mintával Nyakörv', 3400, 'Varázsolja kutyáját egy kis szuperhőssé ebben a lenyűgöző nyakörvben. Az ikonikus Superman logó kék mintával gazdagítva kiemeli kutyája stílusát és egyediségét. Kényelmes viselet mindennapi sétákhoz, az állítható pántok biztosítják az egyedi illeszkedést. A tartós anyagok és a precíz varrások garantálják a hosszú élettartamot. Legyen részese ennek a szuper stílusú nyakörvnek, és tegye kutyáját még különlegesebbé ebben a Supermanes kék mintával díszített kiegészítőben!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv6.jpg', 'collar'),
(137, 'Marveles nyakörv', 3700, 'Varázsolja kutyáját egy kis szuperhőssé ebben az egyedülálló Marvel mintával díszített nyakörvben. A karakteres design és a vibráló színek kiemelik kutyája egyediségét. Kényelmes és strapabíró, ideális mindennapi használatra. Az állítható pántok biztosítják a tökéletes illeszkedést, és a precíz varrások a hosszú élettartamot garantálják. Legyen része ennek a Marvel világát idéző nyakörvnek, és tegye kutyáját különlegessé ebben a karakteres és stílusos kiegészítőben!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv7.jpg', 'collar'),
(138, 'Vasemberes nyakörv', 3500, 'Tegye kutyáját egy valódi szuperhőssé ebben az egyedülálló Iron Man mintával díszített nyakörvben. A karakteres dizájn és az élénk színek kiemelik kutyája egyediségét. Kényelmes viselet mindennapi sétákhoz, az állítható pántok biztosítják az egyedi illeszkedést. A tartós anyagok és a precíz varrások garantálják a hosszú élettartamot. Legyen részese ennek a Marvel világát idéző nyakörvnek, és tegye kutyáját különlegessé ebben a karakteres és stílusos kiegészítőben!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv8.jpg', 'collar'),
(139, 'Kék Nyakörv Villám Mintával', 3200, ' Frissesség és lendület találkozik ebben a stílusos kiegészítőben. A kék szín élénk és vibráló, míg a villám minta kifejezi a dinamizmust. Kényelmes és könnyű viselet mindennapi sétákhoz. Az állítható pántok biztosítják az egyedi illeszkedést, és a strapabíró anyagok a tartósságot. Legyen részese ennek az energikus nyakörvnek, és tegye kutyáját még stílusosabbá ebben a kék nyakörvben villám mintával!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv9.jpg', 'collar'),
(140, 'Barna Nyakörv Villám Mintával', 3200, 'Stílus és dinamizmus egyesül ebben a kifinomult kiegészítőben. A meleg barna szín eleganciát sugároz, míg a villám minta lendülettel tölti meg a nyakörvet. Kényelmes és könnyű viselet mindennapi sétákhoz. Az állítható pántok biztosítják az egyedi illeszkedést, és a strapabíró anyagok a hosszú élettartamot garantálják. Legyen részese ennek az egyedi és stílusos nyakörvnek, és tegye kutyáját még különlegesebbé ebben a barna nyakörvben villám mintával!\r\n\r\n\r\n\r\n\r\n\r\n', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv10.jpg', 'collar'),
(141, ' Fekete Nyakörv Villám Mintával', 3300, 'Az elegancia és lendület találkozása ebben a stílusos kiegészítőben. A fekete szín időtlen és kifinomult, míg a villám minta kifejezi a dinamizmust. Kényelmes és könnyű viselet mindennapi sétákhoz. Az állítható pántok biztosítják az egyedi illeszkedést, és a strapabíró anyagok a hosszú élettartamot garantálják. Legyen részese ennek a fekete nyakörvnek villám mintával, és tegye kutyáját még stílusosabbá ebben az egyedi és modern kiegészítőben!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv11.jpg', 'collar'),
(142, 'Kék Nyakörv Kutyás Mintával', 3500, 'Frissesség és vidámság egyesül ebben a kék nyakörvben, melyet kutyás minta tesz még egyedibbé. A vibráló kék szín lendületet ad, míg a kutyás motívumok kifejezik a szeretetet a háziállatok iránt. Kényelmes és könnyű viselet mindennapi sétákhoz. Az állítható pántok biztosítják az egyedi illeszkedést, és a strapabíró anyagok a hosszú élettartamot garantálják. Legyen részese ennek a stílusos és kedves nyakörvnek, és tegye kutyáját még egyedülállóbbá ebben a kék nyakörvben kutyás mintával!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv12.jpg', 'collar'),
(143, 'Citromsárga Fonásos Nyakörv', 3100, 'A vidámság és stílus egyesül ebben a citromsárga nyakörvben, melyet fonásos minta tesz még egyedibbé. Az élénk szín energiát sugároz, míg a fonásos dizájn eleganciát kölcsönöz. Kényelmes és könnyű viselet mindennapi sétákhoz. Az állítható pántok biztosítják az egyedi illeszkedést, és a strapabíró anyagok a hosszú élettartamot garantálják. Legyen részese ennek a stílusos és egyedi nyakörvnek, és tegye kutyáját még különlegesebbé ebben a citromsárga fonásos mintával díszített kiegészítőben!\r\n\r\n\r\n\r\n\r\n\r\n', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv13.jpg', 'collar'),
(144, ' Amerika Kapitányos Nyakörv', 3500, 'Legyen kutyája a szuperhősök között ebben a lenyűgöző Amerika kapitány mintával díszített nyakörvben. A karakteres design és az élénk színek kiemelik kutyája egyediségét. Kényelmes és könnyű viselet mindennapi sétákhoz. Az állítható pántok biztosítják az egyedi illeszkedést, és a strapabíró anyagok a hosszú élettartamot garantálják. Legyen részese ennek a Marvel világát idéző nyakörvnek, és mutassa meg, hogy kutyája is egy kis szuperhős a szívükben!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv14.jpg', 'collar'),
(145, 'Sötétkék Cápás Nyakörv', 3300, 'Engedje szabadjára kutyájának a cápák erejét ebben a sötétkék nyakörvben, melyet élethű cápaminta tesz különlegessé. Az élénk szín és a karakteres dizájn kiemeli kutyája egyediségét. Kényelmes viselet mindennapi sétákhoz. Az állítható pántok biztosítják az egyedi illeszkedést, és a strapabíró anyagok a hosszú élettartamot garantálják. Legyen részese ennek a stílusos és egyedi nyakörvnek, és mutassa meg, hogy kutyája is képes hordozni a tenger mélyén rejlő erejét!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv15.jpg', 'collar'),
(146, 'Világos Kék Cápás Nyakörv', 3300, 'Engedje kutyájának a cápák izgalmát ebben a világos kék nyakörvben, melyet élethű cápaminta tesz különlegessé. Az élénk szín és a karakteres dizájn kiemeli kutyája egyediségét. Kényelmes viselet mindennapi sétákhoz. Az állítható pántok biztosítják az egyedi illeszkedést, és a strapabíró anyagok a hosszú élettartamot garantálják. Legyen részese ennek a stílusos és egyedi nyakörvnek, és mutassa meg, hogy kutyája is képes hordozni a tenger mélyén rejlő erejét!\r\n\r\n\r\n\r\n\r\n\r\n', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv16.jpg', 'collar'),
(147, 'Sárga Nyakörv Virág Mintákkal', 3200, ' Ragyogjon ki ebben a vidám sárga nyakörvben, melyet színpompás virág minták tesznek még egyedibbé. Az élénk szín és a kifinomult dizájn kiemeli kutyája egyediségét. Kényelmes viselet mindennapi sétákhoz. Az állítható pántok biztosítják az egyedi illeszkedést, és a strapabíró anyagok a hosszú élettartamot garantálják. Legyen részese ennek a stílusos és színes nyakörvnek, és mutassa meg, hogy kutyája is szeretetteljes virágokkal díszített napfény a napjában!\r\n\r\n\r\n\r\n\r\n\r\n', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv17.jpg', 'collar'),
(148, 'Hegy Mintás Nyakörv', 3400, 'Ebben a stílusos nyakörvben a hegyek eleganciája találkozik a természet ihlette dizájnnal. Az egyedi hegy minta kiemeli kutyája kalandvágyát és szabadságát. Kényelmes viselet mindennapi sétákhoz. Az állítható pántok biztosítják az egyedi illeszkedést, és a strapabíró anyagok a hosszú élettartamot garantálják. Legyen részese ennek a természetközeli és stílusos nyakörvnek, és tegye kutyáját még különlegesebbé ebben a hegy mintás kiegészítőben!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv18.jpg', 'collar'),
(149, 'Kék Nyakörv Virág Mintákkal', 3200, 'Színes virágokkal díszített, kék nyakörvünk stílust és eleganciát kölcsönöz kutyájának. Az élénk színű virágok vidámságot sugároznak, míg az állítható pántok biztosítják az egyedi illeszkedést. Kényelmes és könnyű viselet mindennapi sétákhoz. A strapabíró anyagok és a gondos varrások hosszú élettartamot biztosítanak. Legyen részese ennek a kifinomult és vidám kiegészítőnek, és mutassa meg kutyájának stílusát és egyediségét ebben a kék nyakörvben virág mintákkal!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv19.jpg', 'collar'),
(150, 'Elegáns Vörös Nyakörv Mintákkal', 3400, 'Az elegancia és a stílus találkozik ebben a kifinomult vörös nyakörvben, melyet különleges minták tesznek még egyedibbé. A mélyvörös szín hangsúlyozza a kutyája kifinomultságát, míg a mintázatok kifejezik az egyediségét. Kényelmes és könnyű viselet mindennapi sétákhoz. Az állítható pántok biztosítják az egyedi illeszkedést, és a strapabíró anyagok a hosszú élettartamot garantálják. Legyen részese ennek a stílusos és elegáns kiegészítőnek, és emelje ki kutyáját ebben a vörös nyakörvben mintákkal!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv20.jpg', 'collar'),
(151, 'Rózsaszín Kutya Mintás Nyakörv', 3100, 'Ebben a vidám rózsaszín nyakörvben kutyája kifejezheti egyedi stílusát. A kutyaminta játékosságot és kedvességet kölcsönöz a kiegészítőnek. Kényelmes és könnyű viselet mindennapi sétákhoz. Az állítható pántok biztosítják az egyedi illeszkedést, és a strapabíró anyagok a hosszú élettartamot garantálják. Legyen részese ennek a színpompás és egyedi nyakörvnek, és mutassa meg, mennyire különleges és szeretetteljes a kutyája ebben a rózsaszín nyakörvben kutya mintákkal!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv21.jpg', 'collar'),
(152, 'Disney Kutyavilág Nyakörv', 3400, 'Ebben a varázslatos rózsaszín nyakörvben kutyája egyenesen a Disney világába repül. A színpompás kutya minta játékosságot és örömöt kölcsönöz a kiegészítőnek. Kényelmes és könnyű viselet mindennapi sétákhoz. Az állítható pántok biztosítják az egyedi illeszkedést, és a strapabíró anyagok a hosszú élettartamot garantálják. Legyen részese ennek a mesebeli és egyedi nyakörvnek, és mutassa meg, hogy kutyája is része lehet a Disney varázslatnak ebben a rózsaszín nyakörvben kutya mintákkal!\r\n\r\n\r\n\r\n\r\n\r\n', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv22.jpg', 'collar'),
(153, 'Rózsaszín Szerelmes Nyakörv', 3400, 'Ebben a kifejező nyakörvben a szerelem és vidámság találkozik, melyet aranyos kutyás minta szimbolizál. A romantikus szívformák és játékos minták fokozzák a kiegészítő báját. Kényelmes viselet mindennapi sétákhoz. Az állítható pántok biztosítják az egyedi illeszkedést, és a strapabíró anyagok a hosszú élettartamot garantálják. Legyen részese ennek a szeretetteljes és stílusos nyakörvnek, és mutassa meg, hogy kutyája ismeri és osztja a szeretet érzését!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv23.jpg', 'collar'),
(154, 'Rózsaszín Hercegnős Nyakörv', 3200, 'Ebben a varázslatos rózsaszín nyakörvben kutyája úgy érezheti magát, mint egy igazi hercegnő. A bájos hercegnői minta és a lágy rózsaszín színárnyalatok kifinomult eleganciát sugároznak. Kényelmes viselet mindennapi sétákhoz. Az állítható pántok biztosítják az egyedi illeszkedést, és a strapabíró anyagok a hosszú élettartamot garantálják. Legyen részese ennek a mesés és stílusos nyakörvnek, és tegye kutyáját a hercegnővé a mindennapokban!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv24.jpg', 'collar'),
(155, 'Rózsaszín Sárkányos Nyakörv', 3000, 'Ebben a lenyűgöző rózsaszín nyakörvben kutyája kifejezheti belső sárkányát. Az élénk szín és a sárkányminták egyesítése egyedi stílust kölcsönöz a kiegészítőnek. Kényelmes viselet mindennapi sétákhoz. Az állítható pántok biztosítják az egyedi illeszkedést, és a strapabíró anyagok a hosszú élettartamot garantálják. Legyen részese ennek a merész és egyedi nyakörvnek, és mutassa meg, hogy kutyája ismeri a stílus és a játékosság tökéletes egyensúlyát!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv25.jpg', 'collar'),
(156, 'Rózsaszín Képregényes Nyakörv', 3400, 'Ebben a különleges rózsaszín nyakörvben kutyája kelti életre a képregények varázsát. Az élénk szín és a vidám képregény minták egyesítése játékosságot és egyediséget kölcsönöz a kiegészítőnek. Kényelmes viselet mindennapi sétákhoz. Az állítható pántok biztosítják az egyedi illeszkedést, és a strapabíró anyagok a hosszú élettartamot garantálják. Legyen részese ennek a színpompás és kreatív nyakörvnek, és mutassa meg, hogy kutyája ismeri a szórakozás és a stílus harmóniáját!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv26.jpg', 'collar'),
(157, 'Mesevilágos Nyakörv', 3000, 'Varázslatos kiegészítő kutyájának! Ez a különleges nyakörv lenyűgözi a kicsiket és a nagyokat egyaránt. Az élénk színek és a mesebeli karakterek játékosságot és vidámságot kölcsönöznek kutyájának megjelenéséhez. Kényelmes viselet mindennapi sétákhoz. Az állítható pántok biztosítják az egyedi illeszkedést, és a strapabíró anyagok a hosszú élettartamot garantálják. Legyen részese ennek a mesés és egyedi nyakörvnek, és hozza el a mesevilág varázsát mindennapi sétáihoz!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv27.jpg', 'collar'),
(158, 'Kalandos Kutyavilág Nyakörv', 3100, 'Az esszencia minden kutya számára! Ez a lenyűgöző nyakörv ötvözi a stílust és a kényelmet. Az élénk színek és a letisztult dizájn egyedi megjelenést kölcsönöznek kutyájának. Kényelmes viselet mindennapi sétákhoz. Az állítható pántok biztosítják az egyedi illeszkedést, és a strapabíró anyagok a hosszú élettartamot garantálják. Legyen részese ennek a kutyavilág inspirálta és stílusos nyakörvnek, és tegye kutyáját még különlegesebbé minden sétán!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv28.jpg', 'collar'),
(159, 'Virágos Kutyabarát Nyakörv', 3200, 'Ez a bájos nyakörv a virágok szépségét és a kutyákkal való szeretetteljes kapcsolatot ötvözi. Az élénk színek és a cuki kutyus minták harmonikus egyensúlyt teremtenek. Kényelmes viselet mindennapi sétákhoz. Az állítható pántok biztosítják az egyedi illeszkedést, és a strapabíró anyagok a hosszú élettartamot garantálják. Legyen részese ennek a kreatív és stílusos nyakörvnek, és mutassa meg, hogy kutyája ismeri és osztja a természet és a barátság szépségét!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv29.jpg', 'collar'),
(160, 'Kutyus Kavalkád Nyakörv', 3100, 'Ez a különleges nyakörv egy igazi aranyos kijelentése, melyet játékos kutyás minták díszítenek. Az élénk színek és az aranyos kutyusok kombinációja egyedi stílust kölcsönöz. Kényelmes viselet mindennapi sétákhoz. Az állítható pántok biztosítják az egyedi illeszkedést, és a strapabíró anyagok a hosszú élettartamot garantálják. Legyen részese ennek az imádnivaló és stílusos nyakörvnek, és mutassa meg, hogy kutyája ismeri és osztja a játékosság és az aranyosság szeretetét!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv30.jpg', 'collar'),
(161, 'Rajzfilm Kutyakaland Nyakörv', 3200, 'Ez a vidám nyakörv a kedvenc kutyás rajzfilmek varázsát hozza el kutyája számára. A színes és játékos minták egyedi megjelenést kölcsönöznek. Kényelmes viselet mindennapi sétákhoz. Az állítható pántok biztosítják az egyedi illeszkedést, és a strapabíró anyagok a hosszú élettartamot garantálják. Legyen részese ennek a szórakoztató és stílusos nyakörvnek, és mutassa meg, hogy kutyája ismeri és élvezi a rajzfilmek csodálatos világát minden sétán!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv31.jpg', 'collar'),
(162, 'Démonvadász Piros Nyakörv', 3500, 'Ez a lenyűgöző piros nyakörv a démonok erejét és a merész stílust ötvözi. A vibráló piros szín és a démonikus minták egyedi és feltűnő megjelenést kölcsönöznek. Kényelmes viselet mindennapi sétákhoz. Az állítható pántok biztosítják az egyedi illeszkedést, és a strapabíró anyagok a hosszú élettartamot garantálják. Legyen részese ennek a merész és szenvedélyes nyakörvnek, és mutassa meg, hogy kutyája ismeri és vállalja a stílusos és különleges megjelenést minden sétán!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv32.jpg', 'collar'),
(163, 'Éjféli Démon Nyakörv', 3300, 'Ez a stílusos fekete nyakörv a démoni szépséget és erőt tükrözi. A mély fekete szín és a démonikus minták elegáns és különleges megjelenést kölcsönöznek. Kényelmes viselet mindennapi sétákhoz. Az állítható pántok biztosítják az egyedi illeszkedést, és a strapabíró anyagok a hosszú élettartamot garantálják. Legyen részese ennek a titokzatos és stílusos nyakörvnek, és mutassa meg, hogy kutyája ismeri és képviseli a sötétebb és elegánsabb oldalt minden sétán!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv33.jpg', 'collar'),
(164, 'Fekete Vérfarkasos Nyakörv ', 3200, 'Vonzó fekete nyakörvünk a sötétség eleganciáját hozza el kutyájának. Kiváló minőségű anyagból készült, tartós és kényelmes viselet. A stílusos vérfarkas motívumokkal díszítve, egyedivé teszi a megjelenést. A beállítható méret biztosítja, hogy tökéletesen illeszkedjen kutyájához. Ideális mindennapi sétákhoz és különleges alkalmakhoz is. Emelje ki kutyája egyediségét ezzel a különleges nyakörvvel!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv34.jpg', 'collar'),
(165, 'Barna Bőr Nyakörv ', 3100, 'Stílusos sötétbarna bőr nyakörvünk tökéletes kombinációja a klasszikus eleganciának és a modern dizájnnak. Kiváló minőségű, puha bőrből készült, amely tartósságot és kényelmet biztosít. Az állítható méretű nyakörv ideális választás mindennapi sétákhoz és különleges alkalmakhoz egyaránt. A diszkrét, de kifinomult részletek kiemelik kutyája stílusát. Legyen büszke a sétáltatás során ezzel az exkluzív sötétbarna bőr nyakörvvel!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv35.jpg', 'collar'),
(166, 'Piros Vérfarkasos Nyakörvünk', 3300, 'Vonzó piros vérfarkasos nyakörvünk kifejezi a szenvedély és erő egyedülálló kombinációját. Kiváló minőségű anyagból készült, tartós és kényelmes viselet. A merész piros szín és a vad vérfarkas motívumok fokozzák a megjelenést. Az állítható méret lehetővé teszi a tökéletes illeszkedést minden kutyának. Ideális mindennapi sétákhoz és a divatos megjelenéshez. Fejezze ki kutyája egyediségét ezzel a stílusos és lenyűgöző nyakörvvel', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv36.jpg', 'collar'),
(167, 'Vérfarkasos Nyakörvünk', 3200, 'Mystikus vérfarkasos nyakörvünk ötvözi az eleganciát és a titokzatosságot. Kiemelkedő minőségű anyagokból készült, biztosítva a tartósságot és kényelmet. A sötét árnyalatok és a vérfarkas motívumok ötvözése egyedi megjelenést kölcsönöz. Az állítható méretű nyakörv ideális mindennapi viseléshez, és a hangsúlyos stílus kiemeli kutyája egyediségét. A séták sosem voltak még ilyen stílusosak – fedezze fel a sötét vérfarkasos nyakörv varázsát', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv37.jpg', 'collar'),
(168, 'Felhő Mintás Nyakörv', 3200, 'Frissítse fel kutyája megjelenését ezzel a kifinomult felhő mintás nyakörvvel, melyet egy elegáns barna keret ölel körbe. A kiváló minőségű anyagokból készült, tartós és kényelmes viselet. A puha felhő minta és a meleg barna keret tökéletes harmóniát teremtenek, így kutyája stílusa kiemelkedik a tömegből. Az állítható méret biztosítja a tökéletes illeszkedést, és ideálissá teszi mindennapi sétákhoz és különleges alkalmakhoz. Adj hozzá egy kis könnyedséget és eleganciát kutyája életéhez ezzel a divatos nyakörvvel!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv38.jpg', 'collar'),
(169, 'Fekete Nyakörv Rózsa Mintával', 3400, 'Elegáns fekete nyakörvünk rózsa mintával kifejezi a stílus és finomság tökéletes egyensúlyát. Kiváló minőségű anyagokból készült, tartós és kényelmes viselet. A fekete alapon a gyönyörű rózsa minta romantikus és nőies megjelenést kölcsönöz. Az állítható méret lehetővé teszi, hogy kutyája mindenkor kényelmesen és biztonságosan viselhesse. Ideális választás mindennapi sétákhoz és különleges alkalmakhoz is. Emelje ki kutyája eleganciáját ezzel a stílusos fekete nyakörvvel rózsa motívummal!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv39.jpg', 'collar'),
(170, 'Égboltos Nyakörv', 3400, 'Varázslatos égboltot csempészünk kutyája életébe ezzel a különleges nyakörvvel, melyen a felhők és a nap motívuma található. A kiváló minőségű anyagokból készült nyakörv rendkívül tartós és kényelmes viselet. Az égi témájú dizájn a mindennapi séták során felemeli kutyája megjelenését. A szabályozható méret biztosítja az optimális illeszkedést, így kutyája mindig divatosan és kényelmesen viseli. Fedezze fel az égi szépséget ezzel a különleges nyakörvvel, és tegye kutyája sétáit még varázslatosabbá!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv40.jpg', 'collar'),
(171, 'Harmonikus Felhős Nyakörv', 3400, 'Finoman elegáns, gyengéd színű nyakörvünk a természet szépségét hozza el kutyájának. A visszafogott felhős dizájn lágyságot és stílust sugall. A kiváló minőségű anyagokból készült nyakörv kellemes viseletet biztosít, miközben a szép felhős minta kiemeli kutyája megjelenését. Az állítható méretű nyakörv ideális mindennapi használatra és különleges alkalmakra egyaránt. Hozza be a természet harmóniáját kutyája életébe ezzel a gyengéd színű, felhős nyakörvvel', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv41.jpg', 'collar'),
(172, 'Napos Motívumú Nyakörv ', 3000, 'Napsugaras optimizmus és stílus találkozik ebben a gyönyörű nyakörvben, melyet napos motívumok díszítenek. A kiváló minőségű anyagokból készült nyakörv kényelmes viseletet biztosít, míg a napfényes dizájn kifejezi a boldogságot és életörömöt. Az állítható méretű nyakörv ideális mindennapi sétákhoz és különleges alkalmakhoz egyaránt. Fejezze ki kutyája napfényes személyiségét ezzel a különleges és vidám nyakörvvel, amely garantáltan emeli a hangulatot minden sétán!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv42.jpg', 'collar'),
(173, 'Rózsaszín Rózsás Nyakörv', 3300, 'Elegancia és romantika találkozik ebben a fekete nyakörvben, melyet gyönyörű rózsaszín rózsák díszítenek. A kiváló minőségű anyagokból készült nyakörv nemcsak stílusos, hanem kényelmes is viselni. A fekete alap és a rózsaszín rózsák kontrasztja kiemeli kutyája szépségét. Az állítható méret lehetővé teszi a tökéletes illeszkedést, így kutyája mindig divatosan és kényelmesen viselheti. A mindennapi sétákat és különleges alkalmakat emelje ki ezzel a fekete nyakörvvel, melyben a romantika és stílus tökéletes harmóniája ébred életre.', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv43.jpg', 'collar'),
(174, 'Vörös Nyakörv Rózsa Díszítéssel ', 3100, 'Vonzó vörös nyakörvünk a szenvedély és elegancia tökéletes ötvözetét nyújtja, gyönyörű rózsákkal díszítve. A kiváló minőségű anyagokból készült nyakörv tartós és kényelmes viseletet biztosít, miközben a vörös szín és a romantikus rózsák a kutyáját valódi divatikonná teszik. Az állítható méret lehetővé teszi a tökéletes illeszkedést, így kutyája mindig kényelmesen és stílusosan viselheti. Legyen a séták és különleges pillanatok középpontjában ezzel a csodálatos vörös nyakörvvel, mely a szenvedély és a szépség megtestesítője.', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv44.jpg', 'collar');
INSERT INTO `products` (`id`, `name`, `price`, `desc`, `quantity`, `supplier`, `image_path`, `category`) VALUES
(175, 'Barna Napos Nyakörv', 3300, 'Kellemes melegség és stílus összefonódik ebben a barna napos nyakörvben. A kiváló minőségű anyagokból készült nyakörv kényelmes és tartós, ideális mindennapi viseletre. A nap motívumokkal díszítve a nyakörv egyedi megjelenést kölcsönöz kutyájának. Az állítható méret biztosítja a tökéletes illeszkedést, így kutyája mindig divatosan és kényelmesen viselheti. Élvezze a sétákat és különleges pillanatokat ezzel a barna napos nyakörvvel, amelyben a természetes melegség és a stílus harmóniája ébred életre.', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv45.jpg', 'collar'),
(176, 'Fehér Nyakörv', 3000, 'Tisztaság és egyszerű elegancia jellemzi ezt a fehér nyakörvet. A kiváló minőségű anyagokból készült nyakörv könnyű és kényelmes viseletet biztosít, ideális mindennapi sétákhoz és különleges alkalmakhoz egyaránt. Az egyszínű fehér dizájn kihangsúlyozza kutyája természetes szépségét, és lehetőséget teremt a személyre szabásra. Az állítható méret lehetővé teszi a tökéletes illeszkedést, így kutyája mindig stílusosan és kényelmesen viselheti ezt a fehér nyakörvet, amely a tisztaság és egyszerűség jelképe.', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv46.jpg', 'collar'),
(177, 'Rózsaszín Kiskutyás Nyakörv', 3400, 'Szemet gyönyörködtető rózsaszín nyakörvünk kiskutyás mintával garantáltan elvarázsolja mindazokat, akik imádják a kutyusokat. A kiváló minőségű anyagokból készült nyakörv kényelmes és tartós, ideális választás mindennapi sétákhoz és játékos pillanatokhoz. Az aranyos kiskutyás dizájn hozzátesz egy csíkos mosolyt kutyája arcára, és egyedivé teszi megjelenését. Az állítható méret lehetővé teszi a tökéletes illeszkedést. Nyújtson kiskutyájának a rózsaszín kiskutyyás nyakörvvel egy igazán trendi és vidám megjelenést', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv47.jpg', 'collar'),
(178, 'Horror Mintás Nyakörv', 3200, 'Misztikus horror mintás nyakörvünk a sötétség és stílus tökéletes elegye. A kiváló minőségű anyagokból készült nyakörv tartós és kényelmes viseletet biztosít. A rémisztő minták kiemelik kutyája egyediségét és merész személyiségét. Az állítható méretű nyakörv ideális mindennapi sétákhoz és különleges alkalmakhoz is. Vigye magával a sötétebb oldalt sétái során ezzel a különleges horror mintás nyakörvvel, mely a kutyája karakterét és a stílust emeli ki.', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv48.jpg', 'collar'),
(179, 'Fekete Hám', 3000, 'Elegáns fekete hámunk a stílust és tartósságot egyesíti. A kiváló minőségű anyagokból készült hám kényelmes viseletet biztosít, miközben a fekete szín egyszerű és stílusos megjelenést kölcsönöz. Az állítható méret lehetővé teszi, hogy tökéletesen illeszkedjen kutyájához. Ideális választás mindennapi sétákhoz és edzésekhez. Fejezze ki kutyája szépségét és stílusát ezzel a fekete hámunkkal, amely a minimalista design és a funkcionalitás tökéletes egyensúlyát kínálja.', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv49.jpg', 'collar'),
(180, 'Lila Nyakörvünk Kutya Mintával', 3300, 'Bájos lila nyakörvünk kutyás mintával kifejezi a játékosságot és stílust. A kiváló minőségű anyagokból készült nyakörv tartós és kényelmes viseletet biztosít, miközben a lila szín és a kutyás motívumok egyedi megjelenést kölcsönöznek. Az állítható méret lehetővé teszi a tökéletes illeszkedést minden kutyának. Ideális mindennapi sétákhoz és különleges alkalmakhoz egyaránt. Adj hozzá egy kis színt és vidámságot kutyája életéhez ezzel a bájos lila nyakörvvel, mely a stílust és játékosságot ötvözi egyetlen darabban.', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv50.jpg', 'collar'),
(181, 'Fekete Démonos Nyakörv', 3100, 'Misztikus fekete nyakörvünk démonos kapcsol ötvözi a sötétséget és a stílust. A kiváló minőségű anyagokból készült nyakörv tartós és kényelmes viseletet biztosít, miközben a démonos kapcsol dizájnja egyedivé teszi. Az állítható méretű nyakörv ideális mindennapi sétákhoz és különleges alkalmakhoz is. Legyen a kutyája stílusos kísérője ezzel a fekete nyakörvvel, mely a misztikum és a merész design tökéletes harmóniáját képviseli.', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv51.jpg', 'collar'),
(182, 'Zöld Nyakörv Csillagokkal)', 3100, 'Frissítse fel kutyája megjelenését ezzel a zöld nyakörvvel csillagokkal, amely egyedi és stílusos. A kiváló minőségű anyagokból készült nyakörv tartós és kényelmes viseletet biztosít. A zöld szín és a csillagok játékos és vidám hangulatot kölcsönöznek. Az állítható méretű nyakörv ideális választás mindennapi sétákhoz és különleges alkalmakhoz is. Legyen kutyája divatos csillaggal díszített zöld nyakörvével, amely a szépséget és stílust ötvözi egyetlen darabban.', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv52.jpg', 'collar'),
(183, 'Fekete Fehér Mintájú Nyakörv', 3000, 'Elegáns fekete-fehér mintájú nyakörvünk tökéletes harmóniát teremt a kontrasztokkal. Kiváló minőségű anyagokból készült, így nemcsak stílusos, de tartós és kényelmes is. A fekete-fehér design kiemeli kutyája szépségét és egyediségét. Az állítható méret lehetővé teszi a tökéletes illeszkedést, így kutyája mindig divatosan és kényelmesen viselheti. Ideális választás mindennapi sétákhoz és különleges alkalmakhoz. Fedezze fel a fekete-fehér elegancia és stílus kombinációját ezzel a különleges mintájú nyakörvvel!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv53.jpg', 'collar'),
(184, 'Felhő Mintájú Nyakörv', 3000, 'Szellősen elegáns, felhő mintájú nyakörvünk puhaságot és stílust sugároz. Kiváló minőségű anyagokból készült, így nemcsak szemet gyönyörködtető, hanem kényelmes és tartós is. A könnyed felhő minta varázslatos atmoszférát kölcsönöz, emelve kutyája megjelenését. Az állítható méret biztosítja a tökéletes illeszkedést, így kutyája mindig divatosan és kényelmesen viselheti. Ideális választás mindennapi sétákhoz és különleges alkalmakhoz. Engedje, hogy a felhők szárnyaló stílust hozzanak kutyája életébe ezzel a különleges mintájú nyakörvvel!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv54.jpg', 'collar'),
(185, 'Disney Mintás Nyakörv', 3100, 'Varázslatos Disney mintás nyakörvünk a kedvenc karakterek és stílus tökéletes találkozása. Kiváló minőségű anyagokból készült, így nem csak divatos, de kényelmes és tartós is. A Disney karakterek játékosságot és vidámságot hoznak a mindennapokba, kifejezve kutyája egyedi személyiségét. Az állítható méret lehetővé teszi a tökéletes illeszkedést minden kutyának. Egyedi választás mindennapi sétákhoz és különleges alkalmakhoz. Engedje, hogy a Disney mesevilág része legyen kutyája életének ezzel a különleges mintájú nyakörvvel!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv55.jpg', 'collar'),
(186, 'Vérfarkas Mintájú Nyakörv', 3300, 'Misztikus és vad vérfarkas mintájú nyakörvünk a sötétség és stílus tökéletes egyesítése. Kiváló minőségű anyagokból készült, így nem csak lenyűgöző, de kényelmes és tartós is. A vérfarkas motívumok kiemelik a kutyája vad és merész személyiségét. Az állítható méret lehetővé teszi a tökéletes illeszkedést minden kutyának. Egyedi választás mindennapi sétákhoz és különleges alkalmakhoz. Engedje, hogy a vérfarkas minta varázslatosan átszövi kutyája életét ezzel a különleges nyakörvvel', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv56.jpg', 'collar'),
(187, 'Piros Fekete Kockás Nyakörv ', 3400, 'Modern és divatos piros-fekete kockás nyakörvünk kifejezi a merész stílust és egyedi eleganciát. Kiváló minőségű anyagokból készült, így nemcsak trendi, de kényelmes és tartós is. A piros-fekete kockás minta vibráló és feltűnő, kiemelve kutyája egyediségét. Az állítható méret lehetővé teszi a tökéletes illeszkedést minden kutyának. Ideális választás mindennapi sétákhoz és különleges alkalmakhoz. Fejezze ki kutyája játékos és stílusos oldalát ezzel a piros-fekete kockás nyakörvvel!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv57.jpg', 'collar'),
(188, 'Karácsonyi Varázslat Nyakörv', 3300, 'Karácsonyi varázslat nyakörvünkkel kutyája is részese lehet az ünnepi hangulatnak. Kiváló minőségű anyagokból készült, így nemcsak szemet gyönyörködtető, de kényelmes és tartós is. A karácsonyi varázslat mintája minden sétát és ünnepi alkalmat feldob, miközben a karácsonyi csillagok és díszek ragyogóan díszítik a nyakörvet. Az állítható méret lehetővé teszi a tökéletes illeszkedést minden kutyának. Az ideális kiegészítő az ünnepek alatt, amely stílust és varázslatot visz kutyája életébe.', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv58.jpg', 'collar'),
(189, 'Zöld Kockás Nyakörv', 3000, 'Friss és divatos zöld kockás nyakörvünk stílust és kényelmet kínál kutyája számára. A kiváló minőségű anyagokból készült nyakörv tartós és kényelmes viseletet biztosít, miközben a zöld kockás minta játékosságot és energiát kölcsönöz. Az állítható méret lehetővé teszi, hogy tökéletesen illeszkedjen kutyája nyakára. Ideális választás mindennapi sétákhoz és különleges alkalmakhoz. Fejezze ki kutyája egyedi stílusát ezzel a trendi zöld kockás nyakörvvel, amelyben az élénk szín és a divatos minta tökéletes harmóniát alkot.', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv59.jpg', 'collar'),
(190, 'Piros Szív Mintás Nyakörv', 3000, 'Szenvedélyes és szívbe markoló piros szív mintás nyakörvünk a szeretet és stílus tökéletes ötvözetét kínálja. Kiváló minőségű anyagokból készült, így nemcsak gyönyörű, hanem kényelmes és tartós is. A piros szívek játékosságot és érzelmet visznek kutyája életébe. Az állítható méret lehetővé teszi a tökéletes illeszkedést minden kutyának. Ideális választás mindennapi sétákhoz és különleges alkalmakhoz. Adj hozzá egy kis szívvarázslatot és stílust kutyája életéhez ezzel a piros szív mintás nyakörvvel!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv60.jpg', 'collar'),
(191, 'Színes Szív Mintás', 3100, 'Vidám és színes szív mintás nyakörvünk a boldogság és stílus egyvelegét hozza el kutyájának. Kiváló minőségű anyagokból készült, így nemcsak örömteli, de kényelmes és tartós is. A színes szív minta élettel teli és vidám atmoszférát teremt, kifejezve kutyája játékos személyiségét. Az állítható méret lehetővé teszi a tökéletes illeszkedést minden kutyának. Ideális választás mindennapi sétákhoz és különleges alkalmakhoz. Lépjen ki a szürke hétköznapokból ezzel a színes szív mintás nyakörvvel, mely a boldogság és színes stílus tökéletes egyensúlyát nyújtja.', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv61.jpg', 'collar'),
(192, 'Piros Nyakörv Fehér Szívekkel', 3400, 'Élénk és romantikus piros nyakörvünk fehér szívekkel az érzelmek és stílus tökéletes kifejezője. Kiváló minőségű anyagokból készült, így nemcsak szép, hanem kényelmes és tartós is. A piros alap szín és a fehér szív minták kontrasztja egyedi és vonzó megjelenést kölcsönöz kutyájának. Az állítható méret lehetővé teszi a tökéletes illeszkedést minden kutyának. Ideális választás mindennapi sétákhoz és romantikus pillanatokhoz. Varázsolja el kutyája életét ezzel a piros nyakörvvel fehér szívekkel, mely a szerelem és stílus harmóniáját hozza el a mindennapokba.', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv62.jpg', 'collar'),
(193, 'Rózsaszín Virágos Nyakörv', 3400, 'Rózsaszín virágos nyakörvünk a kifinomultság és a természetesség tökéletes találkozása. Kiváló minőségű anyagokból készült, így nemcsak stílusos, de kényelmes és tartós is. A rózsaszín alap szín és a virágos minták romantikus és nőies hangulatot kölcsönöznek kutyájának. Az állítható méret lehetővé teszi a tökéletes illeszkedést minden kutyának. Ideális választás mindennapi sétákhoz és különleges alkalmakhoz. Engedje, hogy a virágok szépsége és a rózsaszín elegancia fokozza kutyája megjelenését ezzel a csodás nyakörvvel!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv63.jpg', 'collar'),
(194, 'Piros Nyakörv Fekete Szívekkel', 3500, 'Szenvedélyes és stílusos, piros nyakörvünk fekete szívekkel kifejezi a szerelmet és az eleganciát. Kiváló minőségű anyagokból készült, így nem csak látványos, de kényelmes és tartós is. A piros alapszín és a fekete szív minták ötvözése vibráló és vonzó megjelenést kölcsönöz kutyájának. Az állítható méret lehetővé teszi a tökéletes illeszkedést minden kutyának. Ideális választás mindennapi sétákhoz és különleges alkalmakhoz. Fejezze ki kutyája szenvedélyét és stílusát ezzel a piros nyakörvvel fekete szívekkel, mely a szerelem és elegancia tökéletes kombinációját hozza el a mindennapokba', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv64.jpg', 'collar'),
(195, 'Kék Nyakörv Csillagokkal', 3500, 'Csodás kék nyakörvünk csillagokkal a stílus és az éjszakai ég szépségét hozza el kutyájának. Kiváló minőségű anyagokból készült, így nemcsak látványos, de kényelmes és tartós is. A kék szín és a csillagok játékos és varázslatos hangulatot kölcsönöznek kutyájának. Az állítható méret lehetővé teszi a tökéletes illeszkedést minden kutyának. Ideális választás mindennapi sétákhoz és különleges alkalmakhoz. Lépjen ki a hétköznapokból ezzel a kék nyakörvvel csillagokkal, mely a stílus és az égi szépség tökéletes egyensúlyát képviseli.', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv65.jpg', 'collar'),
(196, 'Meleg Karácsonyos Nyakörv', 3400, 'Meleg és karácsonyi hangulatot sugárzó barna nyakörvünk tökéletes kiegészítő kutyájának az ünnepi szezonban. Kiváló minőségű anyagokból készült, így nemcsak stílusos, de kényelmes és tartós is. A barna alapszín és a karácsonyi minták megidézik a téli ünnepi hangulatot. Az állítható méret lehetővé teszi a tökéletes illeszkedést minden kutyának. Ideális választás mindennapi sétákhoz és az ünnepi időszakban való különleges megjelenésekhez. Engedje, hogy kutyája részesüljön a melegség és az ünnepi varázslat érzésében ezzel a barna karácsonyi nyakörvvel.', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv66.jpg', 'collar'),
(197, 'Piros Nyakörv', 3000, 'Vonzó és egyszerű, piros nyakörvünk az élénkség és stílus tökéletes reprezentációja. Kiváló minőségű anyagokból készült, így nemcsak feltűnő, de kényelmes és tartós is. A piros szín erőteljes és vonzó, kiemelve kutyája megjelenését. Az állítható méret lehetővé teszi a tökéletes illeszkedést minden kutyának. Ideális választás mindennapi sétákhoz és különleges alkalmakhoz. Egyszerűségében és élénkségében rejlik a piros nyakörv varázsa, amely a stílus és szín harmóniáját hozza el mindennapokba.', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv67.jpg', 'collar'),
(198, 'Masnis  Nyakörv', 3000, 'Elegáns és bájos, masnis nyakörvünk stílust és kényelmet nyújt kutyájának. Kiváló minőségű anyagokból készült, így nemcsak divatos, de kényelmes és tartós is. A finom masni díszítés a kutyája egyedi báját hangsúlyozza. Az állítható méret lehetővé teszi a tökéletes illeszkedést minden kutyának. Ideális választás mindennapi sétákhoz és különleges alkalmakhoz. Adjon hozzá egy kis eleganciát és varázst kutyája életéhez ezzel a masnis nyakörvvel, amely a stílus és báj tökéletes összhangját kínálja.', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv68.jpg', 'collar'),
(199, 'Piros Nyakörv Kövekkel Díszítve', 3300, 'Lenyűgöző és kifinomult, piros nyakörvünk gyönyörű kövekkel díszítve különleges stílust kölcsönöz kutyájának. Kiváló minőségű anyagokból készült, így nemcsak elegáns, de kényelmes és tartós is. A vibráló piros szín és a csillogó kövek kombinációja luxust és vonzerőt sugall. Az állítható méret lehetővé teszi a tökéletes illeszkedést minden kutyának. Ideális választás különleges alkalmakra és elegáns megjelenésekre. Kutyája számára nyújtson kiemelkedő stílust ezzel a piros nyakörvvel kövekkel díszítve, mely a luxus és szépség tökéletes kombinációját kínálja.', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv69.jpg', 'collar'),
(200, 'Ünnepi Masnis Nyakörv', 3400, 'Vidám és színes, piros és zöld színű nyakörvünk egy kis különlegességet varázsol kutyája megjelenésébe. Az elegáns masni az elején stílust és bájt kölcsönöz, kiemelve a kutyája egyediségét. Kiváló minőségű anyagokból készült, így nemcsak feltűnő, de kényelmes és tartós is. Az állítható méret lehetővé teszi a tökéletes illeszkedést minden kutyának. Ideális választás mindennapi sétákhoz és különleges alkalmakhoz. Adjon hozzá egy kis vidámságot és eleganciát kutyája életéhez ezzel a piros és zöld színű nyakörvvel, melyet egy szép masni tesz teljessé', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv70.jpg', 'collar'),
(201, 'Vidám Húsvéti Nyakörv', 3500, 'Vidám, húsvéti hangulatú nyakörvünk egy kis örömet és egyediséget varázsol kutyája megjelenésébe. A különleges színek és minták az ünnepi hangulatot idézik, kifejezve a vidámságot és az ünneplést. Kiváló minőségű anyagokból készült, így nemcsak stílusos, de kényelmes és tartós is. Az állítható méret lehetővé teszi a tökéletes illeszkedést minden kutyának. Ideális választás az ünnepi sétákhoz és különleges alkalmakhoz. Lépjen ki a hétköznapi nyakörvökből, és adja meg kutyájának az ünnepi varázst ezzel a színes és húsvéti hangulatú nyakörvvel.', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv71.jpg', 'collar'),
(202, 'Húsvéti Tojásos Nyakörv', 3400, 'Szórakoztató és húsvéti hangulatot árasztó nyakörvünkön tojások és vidám nyuszik mosolyognak. A kiváló minőségű anyagok kényelmet biztosítanak kutyájának, miközben az egyedi és színes minta kifejezi az ünnepi vidámságot. Az állítható méretnek köszönhetően tökéletesen illeszkedik minden kutyához. Ideális választás az ünnepi sétákhoz és a húsvéti különlegességekhez. Varázsoljon egy mosolyt kutyája arcára ezzel a vidám és témához illő húsvéti nyakörvvel, amely a tavaszi ünnepek örömét hordozza.', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv72.jpg', 'collar'),
(203, 'Varázslatos Húsvéti Nyakörv', 3000, 'Ünnepelje a tavaszi időszakot ezzel a különleges húsvéti mintás nyakörvvel kutyájának! A színes és vidám minták az ünnepi hangulatot tükrözik, hozzájárulva kutyája egyedi megjelenéséhez. Kiváló minőségű anyagokból készült, így nemcsak stílusos, de kényelmes és tartós is. Az állítható méret lehetővé teszi a tökéletes illeszkedést minden kutyának. Ideális választás az ünnepi sétákhoz és eseményekhez, amikor szeretné kutyáját öltöztetni a szezon hangulatába. Fedezze fel a tavaszi örömöket ezzel a húsvéti mintás nyakörvvel, és varázsolja el kutyája és az emberek körülötte szívét egyaránt', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv73.jpg', 'collar'),
(204, 'Rózsaszín Százszorszépes Nyakörv ', 3200, 'Vidám és színes, rózsaszín százszorszép mintával díszített nyakörvünk kifejezi a játékosságot és a frissességet. Kiváló minőségű anyagokból készült, így nemcsak stílusos, de kényelmes és tartós is. A rózsaszín szín és a százszorszép minta kombinációja örömet és életet visz kutyájának megjelenésébe. Az állítható méret lehetővé teszi a tökéletes illeszkedést minden kutyának. Ideális választás mindennapi sétákhoz és különleges alkalmakhoz. Adjon hozzá egy csipetnyi virágos eleganciát kutyája életéhez ezzel a rózsaszín százszorszép nyakörvvel!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv74.jpg', 'collar'),
(205, 'Húsvéti Virágvarázs Nyakörv', 3200, 'Ünnepi hangulatot varázsol kutyája nyakára ezzel a húsvéti virágos, nyuszis és tojásos nyakörvvel! A kiváló minőségű anyagok biztosítják a kényelmet és a tartósságot, míg a színes és vidám minták az ünnepi hangulatot idézik. A virágok és a tavaszi motívumok egyaránt kifejezik a frissességet és a vidámságot. Az állítható méret gondoskodik arról, hogy a nyakörv tökéletesen illeszkedjen minden kutyához. Ideális választás az ünnepi sétákhoz és a tavaszi örömök megosztásához kutyájával. Hozza be a tavaszi ünnepek varázsát ezzel a húsvéti virágos, nyuszis és tojásos nyakörvvel!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv75.jpg', 'collar'),
(206, 'Nyuszis Virágvarázslatos Nyakörv', 3100, 'Keltse életre a tavaszi hangulatot kutyájával ezzel a húsvéti nyakörvvel, melyen színes virágok, vidám nyuszik és bájos őzikék díszítik. A kiváló minőségű anyagok kényelmet és tartósságot biztosítanak, míg az egyedi és vidám minta az ünnepi hangulatot tükrözi. A nyakörv állítható mérete lehetővé teszi a tökéletes illeszkedést minden kutyának. Ideális választás tavaszi sétákhoz és ünnepi eseményekhez. Varázsolja kutyájának megjelenését a tavaszi örömökkel ezen a húsvéti nyakörvvel, mely a természet szépségét ünnepli.', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv76.jpg', 'collar'),
(207, 'Vadon Világ Nyakörv', 3000, 'Varázsolja kutyáját a vadon bájával ezzel a barna nyakörvvel, melyet vadon élő állatok mintája díszít. Az egyedi design és a kiváló minőségű anyagok egyesülése stílusos és tartós kiegészítőt eredményeznek. A barna színű nyakörv egyesíti az eleganciát és a természet szépségét, így kutyája nemcsak divatos, hanem egyben vadon bájos is. Az állítható méret lehetővé teszi a tökéletes illeszkedést minden kutyának. Ideális választás mindennapi sétákhoz és kalandokhoz, amelyekben kutyája stílusosan és kényelmesen viselheti ezt a vadon élő állatokkal díszített barna nyakörvet.', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv77.jpg', 'collar'),
(208, 'Barna Kutya Mintás Nyakörv', 3000, 'Kifejezze kutyája egyediségét ezzel a barna kutya mintás nyakörvvel! Az aranyos kutya minták nemcsak divatosak, hanem kifejezik az állatok iránti szeretetet és tiszteletet. A kiváló minőségű anyagok kényelmet biztosítanak, míg az állítható méret gondoskodik a tökéletes illeszkedésről. Stílusos és praktikus kiegészítő mindennapi sétákhoz és kalandokhoz. Ez a nyakörv nemcsak megjelenésével tűnik ki, hanem kifejezi az állatokkal való kapcsolatát is. Tegye kutyáját divatos és kényelmes stílusba ezzel a barna kutya mintás nyakörvvel!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv78.jpg', 'collar'),
(209, 'Tájképes Nyakörv', 3500, 'Csempéssze be a természetet kutyájának mindennapjaiba ezzel a lenyűgöző tájképes nyakörvvel! A kiváló minőségű anyagok és az élethű tájkép design kombinációja nemcsak stílusos, hanem kényelmes és tartós kiegészítőt is eredményez. Az állítható méretnek köszönhetően tökéletesen illeszkedik minden kutyához. Ideális választás mindennapi sétákhoz és kalandokhoz. Ez a nyakörv nemcsak a szemet gyönyörködteti, hanem a természet szeretetét is kifejezi. Tegye kutyáját stílusos és természetes megjelenésbe ezzel a tájképes nyakörvvel', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv79.jpg', 'collar'),
(210, 'Piros-Fehér Szíves Nyakörv ', 3200, 'Adjon egy csipet romantikát kutyája életébe ezzel a piros-fehér szíves nyakörvvel! Az élénk színek és a szív minták kombinációja a stílust és az érzelmi kapcsolatot hangsúlyozza. Kiváló minőségű anyagokból készült, ez a nyakörv nemcsak divatos, hanem kényelmes és tartós is. Az állítható méret lehetővé teszi a tökéletes illeszkedést minden kutyának. Ideális választás mindennapi sétákhoz és különleges alkalmakhoz. Tegye kutyáját különleges és szeretetteljes stílusba ezzel a piros-fehér szíves nyakörvvel!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv80.jpg', 'collar'),
(211, 'Szívvarázs Nyakörv', 3400, 'Adjon egy csipet romantikát kutyája külsejéhez ezzel a piros nyakörvvel, amelyet fehér szívekkel díszítettünk. Az élénk piros szín és a szív minták kombinációja kifejezi az érzelmi kötődést és a stílusos megjelenést. A kiváló minőségű anyagok biztosítják a kényelmet és a tartósságot, míg az állítható méret garantálja a tökéletes illeszkedést minden kutyának. Ideális választás mindennapi sétákhoz és különleges alkalmakhoz. Ez a nyakörv nemcsak divatos, hanem kifejezi a szeretetét és gondoskodását kutyája iránt. Tegye kutyáját egyedivé ezzel a piros nyakörvvel fehér szív mintákkal!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv81.jpg', 'collar'),
(212, 'Piros Nyakörv Szívekkel ', 3100, 'Ez a kifinomult kiegészítő stílust és kényelmet ötvözi. A prémium minőségű vörös anyag kiemeli kedvenced eleganciáját, míg a fehér szív alakú díszek romantikus hangulatot teremtenek. Az állítható méret biztosítja a tökéletes illeszkedést, míg a könnyű súlyú kivitelezés maximális kényelmet nyújt. Ideális választás sétákhoz és különleges alkalmakra egyaránt. Legyen a kutyusod divatos és kényeztetett – válaszd ezt a varázslatos nyakörvet!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv82.jpg', 'collar'),
(213, 'Elegáns Szíves Nyakörv', 3400, 'Ez a különleges kiegészítő a luxust és romantikát ötvözi. A fekete bőr alap eleganciát sugall, míg a piros szív alakú díszek szenvedélyt és szeretetet tükröznek. Az állítható méretű kialakítás maximális kényelmet nyújt, és ideális mindennapi sétákhoz vagy különleges alkalmakra. A strapabíró anyagok és a részletekbe menő gondosság teszi ezt a nyakörvet kiválóvá. Legyen kutyusod divatos és stílusos – válaszd ezt a romantikus nyakörvet, mely egyedülálló eleganciával emeli ki kedvenced szépségét!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv83.jpg', 'collar'),
(214, 'Színes Tájképes Nyakörv', 3500, 'Ez a varázslatos kiegészítő egyenesen egy természetes tájképbe helyezi kedvenced. A gazdag színekkel rendelkező fák valósághűen festik le a természet szépségét. Az állítható méretű, könnyű nyakörv optimális kényelmet biztosít, miközben stílusos megjelenést kölcsönöz kutyusodnak. Ideális választás a természet szerelmeseinek és az aktív sétákhoz egyaránt. Hozd közelebb a természetet és tedd kutyusodat még egyedibbé ezzel a varázslatos nyakörvvel!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv84.jpg', 'collar'),
(215, 'Vadító Vérfarkasos Nyakörv ', 3400, 'Ez a lenyűgöző kiegészítő a mágia és a vad szépségét hozza el kedvenced életébe. A vérfarkas motívumok élethű kidolgozása minden sétát kalandtá vált. A strapabíró anyagok és az állítható méret garantálják a kényelmet, miközben a nyakörv különleges megjelenése kiemeli kutyusod erőteljes stílusát. Ideális választás a különleges megjelenésre vágyó kutyatulajdonosoknak. Légy te is részese a varázslatos világnak, és válaszd ezt a vérfarkasos nyakörvet, amely egyszerre erős és lenyűgöző!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv85.jpg', 'collar'),
(216, 'Élénk Festékmintás Nyakörv', 3000, 'Ez a színpompás kiegészítő a vidámságot és egyedi stílust hozza kedvenced életébe. A gazdag színek és festékminták harmonikus kombinációja egyedi megjelenést kölcsönöz kutyusodnak. Az állítható méretű nyakörv optimális kényelmet nyújt, így ideális választás mindennapos sétákhoz és kalandokhoz egyaránt. A strapabíró anyagok garantálják a tartósságot, míg a vibráló minták kiemelik kutyusod egyéniségét. Adj színt az életéhez ezzel az élvezetes és divatos festékmintás nyakörvvel!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv86.jpg', 'collar'),
(217, 'Színes Hegymintás Nyakörv', 3200, 'A természet szépségét hozza el kedvenced életébe ez a varázslatos kiegészítő. Harmonikus színek és hegyi motívumok egyedi élményt nyújtanak minden sétához. Az állítható méretű kialakítás kiváló kényelmet biztosít, míg a strapabíró anyagok tartósságot garantálnak. Ideális választás az aktív kutyatulajdonosoknak, akik szeretnék divatosan és kényelmesen kísérni kedvencüket. Adj egy csipetnyi természetet és színt a mindennapokhoz ezzel a színes hegymintás nyakörvvel!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv87.jpg', 'collar'),
(218, 'Mezői Kutyamintás Nyakörv', 3300, ' A nyakörv látványa egy mesés mezőn játszó kutyákat ábrázol, akik virágok között boldogan száguldoznak. A meleg barna színek és finom részletek élettel töltik meg a nyakörvet, harmonikus eleganciát sugallva. Az állítható méretű kialakítás maximális illeszkedést biztosít, miközben a minőségi anyagok tartósságot garantálnak. Ideális választás a természet szerelmeseinek, akik kutyusuknak egyedi stílust szeretnének. Ez a nyakörv nem csupán egy kiegészítő, hanem egy varázslatos történet része, ahol kutyád a virágok között szabadon játszhat. Legyen a te kutyusod is részese ennek a természetközeli va', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv88.jpg', 'collar'),
(219, 'Elegáns Kutyamintás Nyakörv ', 3000, 'A természet ihlette dizájn új dimenziót ad kedvenced stílusához. A barna és fekete árnyalatokon keresztül kutyáid élethűen jelennek meg az erdő lombos öleiben. Az állítható méretű kialakítás tökéletes illeszkedést biztosít, és a nyakörv könnyedén belesimul kutyád nyakába. Minőségi anyagokból készült, tartós és elegáns, ideális mindennapos sétákhoz és különleges kalandokhoz. Ezzel a nyakörvvel kutyusod nem csak kényelmesen, de stílusosan is mutatkozik az erdő varázslatos világában. Legyen része ennek a természetközeli eleganciának!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv89.jpg', 'collar'),
(220, 'Barna-Zöld Kutyamintás Nyakörv', 3400, 'Barna és zöld színek harmonikus játéka egyedi kutyamintás nyakörvön. A kutyák sziluettjei élethűen tükrözik a természet szépségét. Az állítható méretű kialakítás maximális kényelmet biztosít, míg a minőségi anyagok tartósságot és eleganciát garantálnak. Ez a különleges nyakörv nem csak divatos kiegészítő, hanem egy történet, ahol kutyád egyedi mintájával a természet közelében jár. Vidd magaddal a kutyák varázslatos világát, és tedd stílusosabbá mindennapjaitokat ezzel a barna és zöld színű nyakörvvel!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv90.jpg', 'collar'),
(221, 'Barna-Kék Kutyamintás Nyakörv', 3100, 'Barna és kék színek harmóniája egyedi kutyamintás nyakörvön. A kutyák sziluettjei élethűen tükrözik a természet szépségét. Az állítható méretű kialakítás maximális kényelmet biztosít, míg a minőségi anyagok tartósságot és eleganciát garantálnak. Ez a különleges nyakörv nem csak divatos kiegészítő, hanem egy történet, ahol kutyád egyedi mintájával a természet közelében jár. Vidd magaddal a kutyák varázslatos világát, és tedd stílusosabbá mindennapjaitokat ezzel a barna és kék színű nyakörvvel!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv91.jpg', 'collar'),
(222, 'Halloweeni Tökös Nyakörv', 3500, 'Varázslatos stílus és kényelem egyben! A különleges tökök és halloweeni motívumok élettel töltik meg ezt a nyakörvet. A fekete és narancssárga színek játéka kihangsúlyozza a szezon hangulatát. Az állítható méretű kialakítás maximális kényelmet biztosít, míg a strapabíró anyagok garantálják a tartósságot. Ideális választás a sétákhoz és a különleges alkalmakhoz. Legyen kutyusod a Halloween sztárja ezzel az egyedi és stílusos nyakörvvel, ami mindenkit elvarázsol!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv92.jpg', 'collar'),
(223, 'Halloweeni Kutyás Nyakörv', 3500, 'A szezon legizgalmasabb kiegészítője! A fekete és narancssárga színek hátterében vidám kutyás és halloweeni motívumok élednek életre. Az állítható méretű kialakítás kényelmet garantál, így kutyusod a séták során is stílusos marad. A strapabíró anyagok és a precíz kidolgozás biztosítják a tartósságot. Legyen kutyusod a Halloween ünnepének középpontjában ezzel a mókás és egyedi nyakörvvel, amely fokozza a szezon varázsát minden kaland alkalmával!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv93.jpg', 'collar'),
(224, 'Halloweeni Mintájú Nyakörv', 3500, 'Varázslatos stílus és kényelem egyben! A sötét árnyalatok és különleges halloweeni motívumok igazi egyediséget kölcsönöznek ennek a nyakörvnek. Az állítható méretű kialakítás maximális kényelmet nyújt, miközben a strapabíró anyagok biztosítják a tartósságot. Ideális választás a szezonális ünnepségekhez és a különleges alkalmakhoz. Legyen kutyusod a Halloween sztárja ezzel a stílusos és egyedi nyakörvvel, amely kiemeli a szezon varázsát minden sétán és kalandon!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv94.jpg', 'collar'),
(225, 'Egyedi Halloween Mintájú Nyakörv', 3600, 'Varázslatos stílus és személyiség az év legfélelmetesebb ünnepére! A különleges minták, mint a kísérteties házikók és csópos tökök, egyedi karaktert kölcsönöznek ennek a nyakörvnek. Az állítható méretű kialakítás optimális kényelmet nyújt, míg a strapabíró anyagok garantálják a hosszú élettartamot. Ezzel a nyakörvvel kutyád nem csak stílusos lesz, de kiemelkedő részese lehet a Halloween varázsának. Engedd szabadjára a kreativitást és hozd létre a saját stílusos és egyedi Halloweeni megjelenését kutyusodnak!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv95.jpg', 'collar'),
(226, 'Mesebeli Kutya mintás Nyakörv', 3000, 'Egy varázslatos kiegészítő, amelyben a kutyák sziluettjei mesebeli környezetben jelennek meg. A színpompás minták és vidám részletek kutyusod megjelenését feldobják. Az állítható méretű kialakítás optimális kényelmet biztosít, miközben a minőségi anyagok garantálják a tartósságot. Ez a nyakörv nem csupán egy kiegészítő, hanem egy mesés történet része, ahol a kutyád egyedülálló stílusával különleges karakterré válik. Legyen kutyusod is része ennek a mesés világnak, és varázsoljátok együtt még vidámabbá és különlegesebbé a sétákat!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv96.jpg', 'collar'),
(227, 'Varázslatos Halloweeni Nyakörv', 3000, 'Kutyusod stílusát és egyediségét fokozza a mesebeli Halloween motívumokkal díszített nyakörv. A szellemek, csópos tökök és kísérteties minták igazi varázslattá teszik ezt a kiegészítőt. Az állítható méretű kialakítás biztosítja a maximális illeszkedést, míg a strapabíró anyagok garantálják a tartósságot. Ideális választás a szezonális hangulat fokozásához és a különleges sétákhoz. Legyen kutyusod a Halloweeni varázslat középpontjában ezzel a varázslatos nyakörvvel, amely felemeli a kutyád stílusát és a sétákat egyaránt!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv97.jpg', 'collar'),
(228, 'Fekete-Sárga Denevéres Nyakörv', 3600, 'Különleges kiegészítő fekete-sárga színekben és denevérmintával, amely egyedi megjelenést kölcsönöz kedvencednek. Az állítható méretű kialakítás biztosítja a tökéletes illeszkedést, míg a strapabíró anyagok tartósságot garantálnak. A denevéres dizájn különleges atmoszférát teremt, ideális választás a szezonális ünnepségekhez és esti sétákhoz. Stílusosan és biztonságban sétáljatok együtt ezzel a fekete-sárga denevéres nyakörvvel, ami kiemeli kutyusod egyediségét és divatérzékét!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv98.jpg', 'collar'),
(229, 'Elegáns Színes Nyakörv', 3000, 'A lenyűgöző barna, kék és sárga színek kombinációja igazi divatkiállítás. Ez a stílusos és praktikus kiegészítő kiemeli öltözékedet és egyedi stílust kölcsönöz. Az állítható méretű kialakítás optimális illeszkedést biztosít, miközben a strapabíró anyagok tartósságot garantálnak. Ideális választás mindennapi viselethez és különleges alkalmakhoz egyaránt. Legyen színes és stílusos megjelenésed ezzel a nagyövvel, amely a divat és a funkcionalitás tökéletes kombinációját nyújtja.', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv99.jpg', 'collar'),
(230, 'Kék Kristály Mintás Nyakörv', 3100, 'Ebben a varázslatos nyakörvben a kék kristályok eleganciája és egyedisége találkozik. A lenyűgöző minta ragyogó és stílusos megjelenést kölcsönöz kutyusodnak. Az állítható méretű kialakítás optimális illeszkedést biztosít, míg a strapabíró anyagok hosszú élettartamot ígérnek. Ez a nyakörv nem csak kiegészítő, hanem egy valódi ékszer, amely kiemeli kutyád szépségét. Ideális választás mindennapos sétákhoz és különleges alkalmakhoz. Engedd, hogy kutyusod ragyogjon ebben a kék kristály mintás nyakörvben, amely a stílust és a kifinomultságot egyesíti.', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv100.jpg', 'collar'),
(231, 'Világos Festékmintás Nyakörv', 3300, 'Ez a különleges nyakörv a világos festékminták játékos eleganciáját hozza el kutyusod számára. A friss és vidám minták élettel töltik meg ezt a kiegészítőt, kiemelve a kutyád egyediségét. Az állítható méretű kialakítás biztosítja a tökéletes illeszkedést, míg a minőségi anyagok tartósságot garantálnak. Ideális választás a mindennapi sétákhoz és különleges pillanatokhoz. Stílusosan és kényelmesen éljétek mindennapjaitokat ezzel a világos festékmintás nyakörvvel, amely a divat és a kényelem tökéletes egyensúlyát nyújtja.', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv101.jpg', 'collar'),
(232, 'Kék-Sárga Villámos Nyakörv', 3000, 'A merész kék-sárga színkombináció és a modern villámos motívumok kiemelik ezt a nyakörvet. Vibráló színei és egyedi designja különleges stílust kölcsönöznek kutyusodnak. Az állítható méretű kialakítás optimális illeszkedést biztosít, míg a strapabíró anyagok tartósságot garantálnak. Ideális választás a mindennapi sétákhoz és éjszakai kalandokhoz. Stílusosan és biztonságban éljétek meg a sétákat ezzel a kék-sárga villámos nyakörvvel, mely a modern és játékos elegancia tökéletes ötvözete.', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv102.jpg', 'collar'),
(233, 'Félelmetes Halloweeni Nyakörv', 3000, 'Varázslatos kiegészítő, amely a sötét és rémisztő Halloween hangulatát hozza el kutyusod számára. A különleges minták, mint a pókok és a koponyák, egyedi karaktert kölcsönöznek ennek a nyakörvnek. Az állítható méretű kialakítás optimális illeszkedést biztosít, míg a strapabíró anyagok tartósságot garantálnak. Ideális választás a szezonális ünnepségekhez és a különleges sétákhoz. Legyen kutyusod a Halloweeni varázslat középpontjában ezzel a félelmetes nyakörvvel, amely kifinomultan egyesíti a stílust és a szezon szellemét minden kaland alkalmával!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv103.jpg', 'collar'),
(234, 'Szellemes Nyakörv', 3100, 'A kutyusod nyakörvét egyedi kialakítású, halloweeni és szellemes motívumokkal díszítettük. A szellemek és más ikonikus halloweeni elemek egyedi karaktert kölcsönöznek a kiegészítőnek. Az állítható méretű kialakítás optimális illeszkedést biztosít, míg a strapabíró anyagok garantálják a tartósságot. Ideális választás a szezonális ünnepekhez és különleges eseményekhez. Kutyusod stílusosan és egyedien ragyog majd ebben a kreatív és szellemes nyakörvben, amely a szezon szórakozását és a stílusos megjelenést ötvözi minden kaland alkalmával!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv104.jpg', 'collar'),
(235, 'Misztikus Halloweeni Nyakörv', 3000, 'Ebben a különleges kiegészítőben a misztikus és titokzatos elemek találkoznak a Halloween szellemével. A nyakörvöt misztikus motívumok és szezonális ikonok díszítik, kiemelve kutyusod egyediségét. Az állítható méretű kialakítás optimális illeszkedést biztosít, míg a strapabíró anyagok tartósságot garantálnak. Ideális választás a szezonális ünnepségekhez és különleges alkalmakhoz. Legyen kutyusod a Halloween misztikumának középpontjában ezzel a stílusos és egyedi nyakörvvel, amely a misztikumot és a szezon szórakozását ötvözi minden kaland alkalmával!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv105.jpg', 'collar'),
(236, 'Félelmetes Tökös Nyakörv', 3500, 'A Halloween hangulatát és a félelmetes tökök varázsát ebben a különleges nyakörvben élheti át kutyusod. Az ikonikus tökminták kiemelik kutyád stílusát. Az állítható méretű kialakítás optimális illeszkedést biztosít, míg a strapabíró anyagok tartósságot garantálnak. Ideális választás a szezonális ünnepekhez és különleges sétákhoz. Legyen kutyusod a Halloween varázslat középpontjában ezzel a félelmetes tökös nyakörvvel, amely a szezon szórakozását és a stílusos megjelenést ötvözi minden kaland alkalmával!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv106.jpg', 'collar'),
(237, 'Fekete-Vörös Démonos Nyakörv', 3700, 'A sötét és misztikus démoni motívumok eleganciáját hozza el kutyusodnak ez a különleges nyakörv. A fekete és vörös színek összjátéka, valamint a démoni dizájn kiemelik a kiegészítő egyediségét. Az állítható méretű kialakítás optimális illeszkedést biztosít, míg a strapabíró anyagok tartósságot garantálnak. Ideális választás a különleges pillanatokhoz és esti sétákhoz. Stílusosan és magabiztosan éljétek mindennapjaitokat ezzel a fekete-vörös démonos nyakörvvel, amely egyesíti a stílust és a misztikumot minden kaland alkalmával!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv107.jpg', 'collar'),
(238, 'Fekete Villámos Nyakörv', 3000, 'A minimalista elegancia és modern design tökéletes kombinációját kínálja ez a stílusos kiegészítő. A fekete színű nyakörvet villámos minták díszítik, kiemelve kutyusod egyedi megjelenését. Az állítható méretű kialakítás biztosítja a tökéletes illeszkedést, míg a strapabíró anyagok tartósságot garantálnak. Ideális választás mindennapi sétákhoz és stílusos megjelenéshez. Stílusosan és biztonságban sétáljatok együtt ezzel a fekete villámos nyakörvvel, ami egyesíti a modern dizájnt és a praktikus funkcionalitást minden kaland alkalmával!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv108.jpg', 'collar'),
(239, 'Kék Villámos Nyakörv', 3100, 'A frissesség és modernség tökéletes reprezentációját nyújtja ez a kifinomult kiegészítő. A kék színű nyakörvet egyedivé teszik a lendületes villámos minták, kiemelve kutyusod stílusát. Az állítható méretű kialakítás optimális illeszkedést biztosít, míg a strapabíró anyagok tartósságot garantálnak. Ideális választás mindennapi sétákhoz és stílusos megjelenéshez. Sétáljatok együtt bizalommal és stílusban ezzel a kék villámos nyakörvvel, mely a modern dizájnt és a funkcionalitást tökéletesen ötvözi minden kaland alkalmával!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv109.jpg', 'collar'),
(240, 'Fekete-Kék Villámos Nyakörv', 3500, 'A stílus és praktikum tökéletes harmóniáját kínálja ez a különleges kiegészítő. A fekete és kék színek kontrasztja, valamint a lendületes villámos minták kiemelik kutyusod eleganciáját. Az állítható méretű kialakítás optimális illeszkedést biztosít, míg a strapabíró anyagok tartósságot garantálnak. Ideális választás mindennapi sétákhoz és stílusos megjelenéshez. Sétáljatok együtt magabiztosan és trendien ezzel a fekete-kék villámos nyakörvvel, ami a modern dizájnt és a funkcionalitást tökéletesen ötvözi minden kaland alkalmával!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv110.jpg', 'collar'),
(241, 'Sárga Nyíl Mintás Nyakörv', 3000, 'A kreatív és vidám kiegészítő, amely a lendületes design és a friss színek tökéletes kombinációját kínálja. A sárga szín élénkítő hatása és a nyíl minták dinamikus megjelenése kiemeli kutyusod egyediségét. Az állítható méretű kialakítás optimális illeszkedést biztosít, míg a strapabíró anyagok tartósságot garantálnak. Ideális választás a vidám sétákhoz és a stílusos megjelenéshez. Sétáljatok együtt örömteli pillanatokat megéléssel ezzel a sárga színű nyíl mintás nyakörvvel, mely a kényelmet és a divatot tökéletesen ötvözi minden kaland alkalmával!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv111.jpg', 'collar'),
(242, 'Különböző Tökmintájú Nyakörv', 3200, 'Ebben a stílusos és szezonális kiegészítőben a kutyusod stílusa és a divatos tökminták találkoznak. A különböző tökdesignok kreatív és egyedivé teszik ezt a nyakörvet. Az állítható méretű kialakítás biztosítja a tökéletes illeszkedést, míg a strapabíró anyagok tartósságot garantálnak. Ideális választás az őszi sétákhoz és a szezonális stílus megjelenítéséhez. Sétáljatok együtt divatosan és örömteli pillanatokkal ezzel a különböző tökmintájú nyakörvvel, amely a stílust és a szezont tökéletesen ötvözi minden kaland alkalmával!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv112.jpg', 'collar'),
(243, 'Sárga-Fekete Halloweeni Nyakörv', 3400, 'A stílusos kiegészítő, amely a Halloween varázsát és a sárga-fekete kontrasztot ötvözi. A sárga és fekete színek vibráló kombinációja, valamint a halloweeni motívumok kiemelik kutyusod egyedi stílusát. Az állítható méretű kialakítás optimális illeszkedést biztosít, míg a strapabíró anyagok tartósságot garantálnak. Ideális választás a szezonális ünnepekhez és különleges alkalmakhoz. Legyen kutyusod divatos és kényeztetett ebben a sárga-fekete Halloweeni nyakörvben, ami a szezon szórakozását és a stílusos megjelenést ötvözi minden kaland alkalmával!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv113.jpg', 'collar'),
(244, 'Vad Villámos Nyakörv ', 3300, 'A különleges kiegészítő, amely a vadon és modern dizájn elegáns kombinációját hozza el kutyusod számára. A vadmotívumok és a lendületes villámos minták izgalmas kontrasztot teremtenek. Az állítható méretű kialakítás biztosítja a tökéletes illeszkedést, míg a strapabíró anyagok tartósságot garantálnak. Ideális választás a dinamikus sétákhoz és az egyedi megjelenéshez. Legyen kutyusod feltűnő és stílusos ebben a vad villámos nyakörvben, ami a vadon és a modernség varázslatos keverékét kínálja minden kaland alkalmával!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv114.jpg', 'collar'),
(245, 'Misztikus Villámos Nyakörv', 3100, 'A varázslatos kiegészítő, amely a misztikum és modern dizájn izgalmas kombinációját hozza el kutyusod számára. A misztikus motívumok és a lendületes villámos minták egyedi atmoszférát teremtenek. Az állítható méretű kialakítás biztosítja a tökéletes illeszkedést, míg a strapabíró anyagok tartósságot garantálnak. Ideális választás a misztikus sétákhoz és az egyedi megjelenéshez. Legyen kutyusod különleges és stílusos ebben a misztikus villámos nyakörvben, amely misztikumot és modernséget ötvöz minden kaland alkalmával!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv115.jpg', 'collar'),
(246, 'Sötétkék Villámú Nyakörv', 3300, 'A trendi kiegészítő, amely a stílus és dinamizmus tökéletes ötvözete kutyusod számára. A sötétkék szín eleganciát sugároz, míg a villám minták lendületet és egyediséget kölcsönöznek. Az állítható méretű kialakítás biztosítja a tökéletes illeszkedést, míg a strapabíró anyagok tartósságot garantálnak. Ideális választás mindennapi sétákhoz és a divatos megjelenéshez. Legyen kutyusod feltűnő és divatos ebben a sötétkék villámú nyakörvben, ami a stílust és dinamizmust tökéletesen ötvözi minden kaland alkalmával!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv116.jpg', 'collar'),
(247, ' Kék-Lila Villámos Nyakörv', 3400, 'A vibráló kiegészítő, mely a színkavalkád és a modern dizájn tökéletes egyesülését hozza el kutyusod számára. A kék és lila színek kontrasztja, valamint a lendületes villámos minták dinamizmust és egyediséget kölcsönöznek. Az állítható méretű kialakítás biztosítja a tökéletes illeszkedést, míg a strapabíró anyagok tartósságot garantálnak. Ideális választás a színvarázslatos sétákhoz és a különleges megjelenéshez. Legyen kutyusod feltűnő és stílusos ebben a kék-lila villámos nyakörvben, ami a színek gazdagságát és a modern dizájnt tökéletesen ötvözi minden kaland alkalmával!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv117.jpg', 'collar'),
(248, 'Baba Rózsaszínű Nyakörv', 3500, 'A gyengéd és bájos kiegészítő, amely kutyusodat szemet gyönyörködteti. A rózsaszín színű anyag puhasága és a gyermeki motívumok kedvesessé teszik ezt a nyakörvet. Az állítható méretű kialakítás biztosítja a kényelmet és a tökéletes illeszkedést, míg a könnyű súlyú anyagok maximális kényelmet nyújtanak. Ideális választás a mindennapi sétákhoz és a babakutyák stílusos megjelenéséhez. Legyen kutyusod kényeztetett és bájos ebben a baba rózsaszínű nyakörvben, ami a gyengédség és stílus tökéletes kombinációját nyújtja minden kaland alkalmával!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv118.jpg', 'collar'),
(249, 'Fekete-Vörös Tűz Motívumú Nyakörv', 3300, 'A forró és stílusos kiegészítő, amely magabiztosságot sugároz kutyusodnak. A fekete és vörös színek kontrasztja, valamint a tűz motívumok szenvedélyt és erőt kölcsönöznek. Az állítható méretű kialakítás biztosítja a tökéletes illeszkedést, míg a strapabíró anyagok tartósságot garantálnak. Ideális választás azoknak a kutyáknak, akik szeretnek feltűnni és stílusosak lenni. Legyen kutyusod magabiztos és figyelemfelkeltő ebben a fekete-vörös tűz motívumú nyakörvben, ami az erőt és szenvedélyt tökéletesen ötvözi minden kaland alkalmával!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv119.jpg', 'collar'),
(250, 'Fekete Láng Mintájú Nyakörv', 3000, 'A stílusos kiegészítő, mely magabiztosságot és lendületet kölcsönöz kutyusodnak. A fekete szín és a láng motívumok egyedi kontrasztot teremtenek, kiemelve kutyád egyediségét. Az állítható méretű kialakítás biztosítja a tökéletes illeszkedést, míg a könnyű súlyú anyagok maximális kényelmet nyújtanak. Ideális választás a divatos sétákhoz és a különleges megjelenéshez. Legyen kutyusod stílusos és magabiztos ebben a fekete láng mintájú nyakörvben, ami az egyediséget és lendületet tökéletesen ötvözi minden kaland alkalmával!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv120.jpg', 'collar'),
(251, 'Fekete Nyakörv Tűzes Mintával', 3800, 'Kiemelkedjen a stílusával a Fekete Nyakörvvel Tűzes Mintával! Ez a lenyűgöző kiegészítő ideális választás mindennapi sétákhoz. A fekete nyakörv időtálló és elegáns, míg a tűzes minta játékosságot kölcsönöz. Az állítható pántoknak köszönhetően könnyen illeszkedik minden kutya nyakához, és az elülső csat gyorsan rögzíti a nyakörvet. A tartós anyagok garantálják a hosszú élettartamot, miközben a kényelmes viseletért felelnek. Ez a Fekete Nyakörv Tűzes Mintával divatos és funkcionális választás, hogy kutyájával együtt élvezhesse a sétákat!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv121.jpg', 'collar'),
(252, 'Tüzes Nyakörv', 3200, 'Lángokban égő stílus a Tüzes Nyakörvvel! Ez a lenyűgöző nyakörv nemcsak élénk tűzpiros színével, hanem lángokat ábrázoló dizájnjával is kimagasló. Az állítható pánt lehetővé teszi az egyedi illeszkedést, míg a masszív fém csat gyors és biztonságos rögzítést biztosít. Kényelmes viselet mindennapi sétákhoz, a lángok pedig kifejezik a kutyája energikus és szenvedélyes oldalát. Legyen a kutyája lángolóan stílusos a Tüzes Nyakörvvel!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv122.jpg', 'collar'),
(253, 'Tűz Mintás Nyakörv', 3000, 'Lángokban égő stílus a Tűz Mintás Nyakörvvel! Ez a lenyűgöző nyakörv nemcsak élénk tűzpiros színével, hanem tűz lángjait ábrázoló dizájnjával is kimagasló. Az állítható pánt lehetővé teszi az egyedi illeszkedést, míg a masszív fém csat gyors és biztonságos rögzítést biztosít. Kényelmes viselet mindennapi sétákhoz, a tűzminták pedig kifejezik a kutyája dinamikus és szenvedélyes oldalát. Legyen a kutyája lángolóan stílusos a Tűz Mintás Nyakörvvel!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv123.jpg', 'collar');
INSERT INTO `products` (`id`, `name`, `price`, `desc`, `quantity`, `supplier`, `image_path`, `category`) VALUES
(254, 'Láng Mintás Nyakörv', 3100, 'Tűzpiros szenvedély és lendület a Láng Mintás Nyakörvvel! Ez a lenyűgöző nyakörv égő lángokat ábrázoló dizájnjával és élénk tűzpiros színével kiemelkedik. Az állítható pánt lehetővé teszi az egyedi illeszkedést, míg a masszív fém csat gyors és biztonságos rögzítést biztosít. Kényelmes viselet mindennapi sétákhoz, és a lángminták kifejezik a kutyája dinamizmusát és energiáját. Legyen a kutyája kirobbanóan stílusos a Láng Mintás Nyakörvvel!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv124.jpg', 'collar'),
(255, 'Fekete Tűz Mintás Nyakörv', 3200, 'Sötét elegancia és lendület a Fekete Tűz Mintás Nyakörvvel! Ez a lenyűgöző nyakörv égő lángokat ábrázoló dizájnnal, melyet a mély fekete szín tesz még kifinomultabbá. Az állítható pánt lehetővé teszi az egyedi illeszkedést, míg a masszív fém csat gyors és biztonságos rögzítést biztosít. Kényelmes viselet mindennapi sétákhoz, és a fekete tűzminták kifejezik a kutyája rejtett erősségét és eleganciáját. Legyen a kutyája fekete luxusban a Fekete Tűz Mintás Nyakörvvel!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv125.jpg', 'collar'),
(256, 'Tűz Mintás Nyakörv', 3300, 'Szenvedély és lendület a Tűz Mintás Nyakörvvel! Ez a lenyűgöző nyakörv égő lángokat ábrázoló dizájnnal kimagasló. Az állítható pánt lehetővé teszi az egyedi illeszkedést, míg a masszív fém csat gyors és biztonságos rögzítést biztosít. Kényelmes viselet mindennapi sétákhoz, és a lángminták kifejezik a kutyája dinamizmusát és energiáját. Legyen a kutyája lángolóan stílusos a Tűz Mintás Nyakörvvel!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv126.jpg', 'collar'),
(257, 'Absztrakt Mintás Nyakörv', 3400, 'Kreativitás és modern stílus az Absztrakt Mintás Nyakörvvel! Ez a lenyűgöző nyakörv egyedi, absztrakt mintáival különleges megjelenést kölcsönöz kedvencének. Az állítható pánt lehetővé teszi az egyedi illeszkedést, míg a masszív fém csat gyors és biztonságos rögzítést biztosít. Kényelmes viselet mindennapi sétákhoz, és az absztrakt minták kifejezik a kutyája egyediségét és modern stílusát. Legyen a kutyája divatos és kreatív az Absztrakt Mintás Nyakörvvel!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv127.jpg', 'collar'),
(258, 'Kék - Sárga Csillagos Nyakörv', 2900, 'Elegancia és csillogás találkozik a Kék-Sárga Csillagos Nyakörvben! Ez a különleges nyakörv nemcsak a szép kék-sárga színkombinációval ragyog, hanem csillagos díszítéssel is kiemelkedik. Az állítható pánt biztosítja az egyedi illeszkedést, míg a masszív fém csat gyors és biztonságos rögzítést biztosít. Kényelmes viselet mindennapi sétákhoz, a csillagos design pedig különleges stílust kölcsönöz. Legyen a kutyája divatos és csillogó a Kék-Sárga Csillagos Nyakörvvel, amely garantáltan felhívja magára a figyelmet!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv128.jpg', 'collar'),
(259, 'Piros Bőr Nyakörv', 3300, 'Stílus és időtlen elegancia a Piros Bőr Nyakörvvel! Ez a kifinomult nyakörv élénk piros színével és prémium bőr anyagával kiemelkedik. Az állítható pánt lehetővé teszi az egyedi illeszkedést, míg a masszív fém csat biztosítja a gyors és biztonságos rögzítést. Kényelmes viselet mindennapi sétákhoz, és a bőr idővel még szebbé válik. Legyen a kutyája stílusos és elegáns a Piros Bőr Nyakörvvel, amely egyesíti a divatot és a tartósságot!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv129.jpg', 'collar'),
(260, 'Színes Figurás Nyakörv', 3400, 'Egyedi stílus és vidám megjelenés a Színes Figurás Nyakörvvel! Ez a különleges nyakörv élénk színekben pompázik és szórakoztató figurákkal díszített. Az állítható pánt lehetővé teszi az egyedi illeszkedést, míg a masszív fém csat biztosítja a gyors és biztonságos rögzítést. Kényelmes viselet mindennapi sétákhoz, és a színes figurás design egyedi karaktert kölcsönöz kedvencének. Legyen a kutyája szórakoztató és stílusos a Színes Figurás Nyakörvvel, ami garantáltan felhívja a figyelmet!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv130.jpg', 'collar'),
(261, 'Sárga Cartoon Nyakörv', 2900, 'Vidám és színes megjelenés a Sárga Cartoon Nyakörvvel! Ez a különleges nyakörv nemcsak élénk sárga színével, hanem szórakoztató kis rajzokkal is feldobja kedvencét. Az állítható pánt lehetővé teszi az egyedi illeszkedést, míg a masszív fém csat biztosítja a stabil rögzítést. Kényelmes viselet mindennapi sétákhoz, és a vidám design kifejezi a kutyája játékos és örömteli oldalát. Legyen a kutyája színes és egyedi a Sárga Cartoon Nyakörvvel!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv131.jpg', 'collar'),
(262, 'Piros Cartoon Nyakörv', 2700, 'Stílusos és vidám megjelenés a Piros Cartoon Nyakörvvel! Ez a különleges nyakörv nemcsak élénk piros színével, hanem szórakoztató rajzokkal is feldobja kedvencét. Az állítható pánt lehetővé teszi az egyedi illeszkedést, míg a masszív fém csat biztosítja a stabil rögzítést. Kényelmes viselet mindennapi sétákhoz, és a vidám design kifejezi a kutyája játékos és örömteli oldalát. Legyen a kutyája stílusos és vidám a Piros Cartoon Nyakörvvel!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv132.jpg', 'collar'),
(263, 'Piros - Kék Cartoon Nyakörv', 3100, 'Egyedi és színpompás megjelenés a Piros-Kék Cartoon Nyakörvvel! Ez a különleges nyakörv nemcsak élénk piros és kék színeivel tűnik ki, hanem szórakoztató rajzokkal is díszített. Az állítható pánt lehetővé teszi az egyedi illeszkedést, míg a masszív fém csat biztosítja a stabil rögzítést. Kényelmes viselet mindennapi sétákhoz, és a vidám design kifejezi a kutyája játékos és színes oldalát. Legyen a kutyája stílusos és egyedi a Piros-Kék Cartoon Nyakörvvel!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv133.jpg', 'collar'),
(264, 'Színes Cartoon Nyakörv', 3300, 'Vidám és színes megjelenés a Színes Cartoon Nyakörvvel! Ez a különleges nyakörv nemcsak élénk színeivel, hanem szórakoztató kis rajzokkal is lenyűgözi. Az állítható pánt lehetővé teszi az egyedi illeszkedést, míg a masszív fém csat biztosítja a stabil rögzítést. Kényelmes viselet mindennapi sétákhoz, és a vidám design kifejezi kedvence játékos oldalát. Legyen a kutyája színes és egyedi a Színes Cartoon Nyakörvvel, amely garantáltan mosolyt csal mindenkinek az arcára!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv134.jpg', 'collar'),
(265, 'Színes Művészi Nyakörv', 2900, 'Kifejező művészet a Színes Művészi Nyakörvvel! Ez a rendkívüli nyakörv lenyűgözi színeivel és absztrakt mintáival. Az állítható pánt lehetővé teszi az egyedi illeszkedést, míg a masszív fém csat gyors és biztonságos rögzítést biztosít. Kényelmes viselet mindennapi sétákhoz, és a színpompás design kifejezi a művészi érzéket. Legyen a kutyája kifejező és stílusos a Színes Művészi Nyakörvvel, amely a művészi szabadság és kreativitás szimbóluma!\r\n\r\n\r\n\r\n\r\n\r\n', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv135.jpg', 'collar'),
(266, 'Pókemberes Nyakörv', 3200, 'Mutassa meg a kutyája szuperhős oldalát a Pókemberes Nyakörvvel! Ez a különleges nyakörv nemcsak a Pókember logóval, hanem élénk színeivel is kiemelkedik. Az állítható pánt lehetővé teszi az egyedi illeszkedést, míg a masszív fém csat biztosítja a gyors és biztonságos rögzítést. Kényelmes viselet mindennapi sétákhoz, és a karakteres design kifejezi kedvence játékos és kalandvágyó oldalát. Legyen a kutyája a szórakoztató és stílusos Pókemberes Nyakörvvel!\r\n\r\n\r\n\r\n\r\n\r\n', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv136.jpg', 'collar'),
(267, 'Batman Nyakörv', 3400, 'Stílusos és erőteljes megjelenés a Batman Nyakörvvel! Ez a karakteres nyakörv a Batman emblémával rendelkezik, kiemelve kedvence különleges oldalát. Az állítható pánt biztosítja az egyedi illeszkedést, míg a masszív fém csat garantálja a gyors és biztonságos rögzítést. Kényelmes viselet a mindennapi sétákhoz, és a Batman logóval ellátott design egyedi stílust kölcsönöz. Legyen a kutyája az utcák hőse a Batman Nyakörvvel!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv137.jpg', 'collar'),
(268, 'Kék Batman Nyakörv', 3500, 'Mutassa be kedvencét a Kék Batman Nyakörvvel! Ez a karakteres nyakörv nemcsak a népszerű Batman emblémával büszkélkedik, de élénk kék színével is kiemeli kedvencének stílusát. Az állítható pánt biztosítja az egyedi illeszkedést, míg a masszív fém csat gyors és biztonságos rögzítést nyújt. Kényelmes viselet a mindennapi sétákhoz, és a kék Batman logóval ellátott design igazi stílusnyilatkozat. Legyen a kutyája egyedi és stílusos a Kék Batman Nyakörvvel!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv138.jpg', 'collar'),
(269, 'Kék Bőr Nyakörv', 3200, 'Stílus és tartósság találkozik a Kék Bőr Nyakörvvel! Ez a kifinomult nyakörv nemcsak élénk kék színével vonzza a tekintetet, hanem prémium minőségű bőr anyagával is kiemelkedik. Az állítható pánt lehetővé teszi az egyedi illeszkedést, míg a masszív fém csat gyors és biztonságos rögzítést biztosít. Kényelmes viselet mindennapi sétákhoz, és a bőr idővel egyre szebbé válik. Legyen a kutyája stílusos és elegáns a Kék Bőr Nyakörvvel, amely időtálló divatot képvisel!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv1.jpg', 'collar'),
(270, 'Színes Batman Nyakörv', 3400, 'Egyedi stílus a Színes Batman Nyakörvvel! Ez a rendkívüli nyakörv nemcsak színpompás dizájnjával, hanem a Batman emblémával is kiemelkedik. Az állítható pánt lehetővé teszi az egyedi illeszkedést, míg a masszív fém csat gyors és biztonságos rögzítést biztosít. Kényelmes viselet mindennapi sétákhoz, és a karakteres design kifejezi kedvence személyiségét. Legyen a kutyája egyedi és stílusos a Színes Batman Nyakörvvel, amely garantáltan a figyelem középpontjába helyezi!', 10, 'Forgalmazó', 'imgs/productPhotos/nyakorv139.jpg', 'collar');
